window.html_templates = {
  "appointment_request/appointment_request.tpl.html": "<ion-view class=\"page-view phe-card-viewer\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n  <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n      <button class=\"button button-icon\" ng-click=\"ctrl.back();\">\n        <i class=\"icon ion-ios-arrow-left\"></i>\n      </button>\n      <h2 class=\"title\">Seleccionar cita</h2>\n      <div class=\"buttons\">\n      </div>\n  </ion-header-bar>\n\n  <ion-content>\n    <!-- CALENDAR COMPONENT -->\n    <div class=\"phe-drawer-vertical ng-hide overflow\" ng-show=\"ctrl.show_calendar\">\n      <div class=\"phe-drawer-content\">\n        <div class=\"phe-full\">\n            <!--<div class=\"phe-drawer-close text-left\" ng-click=\"ctrl.toogle_select_content()\">Cerrar</div>-->\n            <app-calendar-directive annual-view=\"ctrl.annual_view\" selected=\"ctrl.day\" events=\"ctrl.events\" on-select-day=\"ctrl.onSelectDay(day)\" on-next-month=\"ctrl.onNextMonth()\"\n                on-previous-month=\"ctrl.onPreviousMonth()\" selectable=\"ctrl.selectable\" on-month-select=\"ctrl.onMonthSelect(month,year)\"\n                on-show-month=\"ctrl.hideHours(bool)\">\n            </app-calendar-directive>\n        </div>\n        <br>\n        <div class=\"row phe-drawer-second-content\">\n            <div class=\"col col-33\" ng-repeat=\"hour in ctrl.hours | orderBy: hour\"\n                  ng-click=\"ctrl.onSelectHour('{{hour}}')\">\n                <button class=\"button button-outline button-positive phe-appointment-request-hour\">{{hour}}</button>\n            </div>\n        </div>\n        <div class=\"row phe-list-no-items\" ng-show=\"ctrl.noCalendarHours\">\n            <div class=\"col text-center\">\n                <i class=\"icon ion-clock\"></i>\n                <span>{{'no_hours'|translate}}</span>\n            </div>\n        </div>\n        <div class=\"row phe-list-no-items\" ng-hide=\"ctrl.user_day_set\">\n            <div class=\"col text-center\">\n                <i class=\"icon ion-clock\"></i>\n                <span>{{'select_a_day_appointments'|translate}}</span>\n            </div>\n        </div>\n      </div>\n    </div>\n\n    <div class=\"phe-drawer-mask ng-hide\" ng-if=\"ctrl.show_calendar\">\n    </div>\n\n    <!-- END CALENDAR COMPONENT -->\n  </ion-content>\n\n</ion-view>",
  "calendar/views/calendar.tpl.html": "<!--div class=\"loading\" ng-class=\"{loading: isLoading}\"><img src=\"../img/load_calendar.gif\"/></div-->\n<div ng-if=\"annualView\" class=\"row yearHeader\">\n    <a class=\"col text-right\" ng-show=\"showMonthView\" ng-click=\"showYear()\">\n        <div class=\"phe-button-calendar\">\n            {{'Annual_view' | translate}}\n        </div>\n    </a>\n</div>\n<div id=\"year\" class=\"header\" ng-show=\"!showMonthView\">\n    <div class=\"passmonth\" ng-click=\"prevYear()\"><i class=\"icon ion-ios-arrow-left\"></i></div>\n    <div class=\"month\"><span>{{year}}</span></div>\n    <div class=\"passmonth\" ng-click=\"nextYear()\"><i class=\"icon ion-ios-arrow-right\"></i></div>\n</div>\n<div id=\"yearView\" ng-show=\"!showMonthView\" class=\"calendar-year-view\">\n    <div class=\"row\">\n        <div id=\"month1\" class=\"col\" ng-click=\"setMonth(1,year)\"></div>\n        <div id=\"month2\" class=\"col\" ng-click=\"setMonth(2,year)\"></div>\n        <div id=\"month3\" class=\"col\" ng-click=\"setMonth(3,year)\"></div>\n    </div>\n    <div class=\"row\">\n        <div id=\"month4\" class=\"col\" ng-click=\"setMonth(4,year)\"></div>\n        <div id=\"month5\" class=\"col\" ng-click=\"setMonth(5,year)\"></div>\n        <div id=\"month6\" class=\"col\" ng-click=\"setMonth(6,year)\"></div>\n    </div>\n    <div class=\"row\">\n        <div id=\"month7\" class=\"col\" ng-click=\"setMonth(7,year)\"></div>\n        <div id=\"month8\" class=\"col\" ng-click=\"setMonth(8,year)\"></div>\n        <div id=\"month9\" class=\"col\" ng-click=\"setMonth(9,year)\"></div>\n    </div>\n    <div class=\"row\">\n        <div id=\"month10\" class=\"col\" ng-click=\"setMonth(10,year)\"></div>\n        <div id=\"month11\" class=\"col\" ng-click=\"setMonth(11,year)\"></div>\n        <div id=\"month12\" class=\"col\" ng-click=\"setMonth(12,year)\"></div>\n    </div>\n</div>\n<div class=\"header\" ng-show=\"showMonthView\">\n    <div class=\"passmonth\" ng-click=\"previous()\"><i class=\"icon ion-ios-arrow-left\"></i></div>\n    <div class=\"month\"><span>{{month.format(\"MMMM YYYY\")}}</span></div>\n    <div class=\"passmonth\" ng-click=\"next()\"><i class=\"icon ion-ios-arrow-right\"></i></div>\n</div>\n<div class=\"week names\" ng-show=\"showMonthView\">\n    <span class=\"day\">{{'mon' | translate}}</span>\n    <span class=\"day\">{{'tue' | translate}}</span>\n    <span class=\"day\">{{'wed' | translate}}</span>\n    <span class=\"day\">{{'thu' | translate}}</span>\n    <span class=\"day\">{{'fri' | translate}}</span>\n    <span class=\"day\">{{'sat' | translate}}</span>\n    <span class=\"day\">{{'sun' | translate}}</span>\n</div>\n<div class=\"week\" ng-repeat=\"week in weeks\" ng-show=\"showMonthView\">\n    <span class=\"day\" ng-class=\"{\n        today: day.isToday,\n        'different-month': !day.isCurrentMonth,\n        selected: day.date.isSame(selected),\n        events: day.areEvents,\n        selectable: day.isSelectable,\n        notSelectable: !day.isSelectable }\"\n        ng-click=\"!day.isSelectable || select(day)\" ng-repeat=\"day in week.days\">\n        {{day.number}}\n    </span>\n</div>",
  "call/views/incoming_call.tpl.html": "<div class=\"phe-incoming-call-wrapper pane\" ng-show=\"ctrl.show_incoming_call_wrapper\">\n\n  <div class=\"phe-incoming-call-caller-image\">\n    <div class=\"phe-incoming-call-avatar-waves\"></div>\n    <phe-avatar phe-user=\"ctrl.consultant\"></phe-avatar>\n  </div>\n\n  <div class=\"phe-incoming-call-caller-info\">\n    <div class=\"phe-incoming-call-caller-name\">{{::ctrl.consultant.presentation_name}}</div>\n    <div class=\"phe-incoming-call-service-name\">{{::ctrl.service_name}}</div>\n  </div>\n\n  <div class=\"phe-incoming-call-type-text\">\n    {{ctrl.info_message}}\n  </div>\n\n  <div class=\"phe-incoming-call-buttons\">\n    <div class=\"phe-incoming-call-button cancel assertive-bg icon ion-ios-telephone animated\" ng-class=\"{true:'zoomIn',false:'zoomOut'}[ctrl.action_pending]\" ng-click=\"ctrl.reject_call()\"></div>\n    <div class=\"phe-incoming-call-button balanced-bg icon ion-ios-telephone animated\" ng-class=\"{true:'zoomIn',false:'zoomOut'}[ctrl.action_pending]\" ng-click=\"ctrl.accept_call()\"></div>\n  </div>\n</div>\n",
  "call/views/outgoing_call.tpl.html": "<div class=\"phe-incoming-call-wrapper pane\">\n\n  <div class=\"phe-incoming-call-caller-image\">\n    <div class=\"phe-incoming-call-avatar-waves\"></div>\n    <phe-avatar phe-user=\"ctrl.consultant\"></phe-avatar>\n  </div>\n\n  <div class=\"phe-incoming-call-caller-info\">\n    <div class=\"phe-incoming-call-caller-name\">{{::ctrl.consultant.presentation_name}}</div>\n    <div class=\"phe-incoming-call-service-name\">{{::ctrl.service_name}}</div>\n  </div>\n\n  <div class=\"phe-incoming-call-logo\">\n    <img src=\"{{$root.theme_path}}/img/logo.png\" alt=\"logo\"/>\n  </div>\n\n  <div class=\"phe-incoming-call-type-text\">\n    {{ctrl.info_message}}\n  </div>\n\n  <div class=\"phe-incoming-call-buttons\">\n    <div class=\"phe-incoming-call-button cancel assertive-bg icon ion-ios-telephone animated\" ng-class=\"{true:'zoomIn',false:'zoomOut'}[ctrl.action_pending]\" ng-click=\"ctrl.cancel_call()\"></div>\n  </div>\n</div>\n",
  "call/views/videocall.tpl.html": "<div\n  ng-show=\"ctrl.initialized\"\n  class=\"phe-videocall-wrapper animated\"\n  data-id=\"main-wrapper\"\n  on-drag-start=\"ctrl.start_drag_remote($event)\"\n  on-drag=\"ctrl.on_drag_remote($event)\"\n  ng-class=\"[{true:'zoomIn',false:'zoomOut'}[ctrl.call_connected],{false:'minimized'}[ctrl.fullscreen],{true:'audio'}[ctrl.is_audio_call]]\">\n\n  <!-- VIDEO CALL -->\n  <div ng-show=\"ctrl.is_video_call\">\n\n    <!-- REMOTE VIDEO -->\n    <div\n      class=\"phe-videocall-video remote\"\n      draggable=\"true\"\n      on-tap=\"ctrl.click_handler()\"\n      on-drag-start=\"ctrl.start_drag_remote($event)\"\n      on-drag=\"ctrl.on_drag_remote($event)\">\n    </div>\n\n    <!-- LOCAL VIDEO -->\n    <div\n      class=\"phe-videocall-video local\"\n      ng-class=\"[{true:'with-toolbar'}[ctrl.show_toolbar],{true:'no-animation'}[ctrl.dragging],{false:'no-camera'}[ctrl.camera_enabled]]\"\n      draggable=\"true\"\n      on-drag-start=\"ctrl.start_drag_local($event)\"\n      on-drag=\"ctrl.on_drag_local($event)\">\n    </div>\n\n    <!-- CALL HEADER -->\n    <div class=\"phe-videocall-header\">\n      <div class=\"phe-video-call-header-left\"></div>\n      <div class=\"phe-video-call-header-center phe-videocall-info\">\n        <div class=\"phe-videocall-info-name phe-text-ellipsis\">{{ctrl.consultant.presentation_name}}</div>\n        <div class=\"phe-videocall-info-duration\">\n          <timer autostart=\"false\" interval=\"1000\">{{mminutes}}:{{sseconds}}</timer>\n        </div>\n      </div>\n      <div class=\"phe-video-call-header-right phe-video-call-chat\" ng-click=\"ctrl.toggle_fullscreen()\">\n        <i class=\"ion ion-chatbox-working\"></i>\n        <span ng-if=\"ctrl.badge_number > 0\" class=\"badge badge-assertive mini\" id=\"badge\">{{ctrl.badge_number}}</span>\n      </div>\n    </div>\n\n    <!-- ACTIONS TOOLBAR -->\n    <div class=\"phe-videocall-toolbar\">\n      <div ng-class=\"[{true:'fadeInUp',false:'fadeOutDown'}[ctrl.show_toolbar],{false:'phe-bg-orange'}[ctrl.micro_enabled]]\" ng-click=\"ctrl.toggle_audio()\" class=\"action animated\">\n        <i ng-class=\"{true:'ion-android-microphone-off',false:'ion-android-microphone'}[ctrl.micro_enabled]\" class=\"icon\"></i>\n      </div>\n      <div ng-class=\"[{true:'fadeInUp',false:'fadeOutDown'}[ctrl.show_toolbar],{false:'phe-bg-orange'}[ctrl.camera_enabled]]\" ng-click=\"ctrl.toggle_video()\" class=\"action animated\">\n        <i ng-class=\"{true:'ion-eye-disabled',false:'ion-eye'}[ctrl.camera_enabled]\" class=\"icon\"></i>\n      </div>\n      <div ng-show=\"ctrl.can_toggle_camera\" ng-class=\"{true:'fadeInUp',false:'fadeOutDown'}[ctrl.show_toolbar]\" ng-click=\"ctrl.toggle_camera()\" class=\"action animated\"><i ng-class=\"{true:'ion-ios-reverse-camera',false:'ion-ios-camera'}[ctrl.front_camera]\" class=\"icon\"></i></div>\n      <div ng-class=\"{true:'fadeInUp',false:'fadeOutDown'}[ctrl.show_toolbar]\" ng-click=\"ctrl.hangup()\" class=\"action animated phe-bg-red\">\n        <i class=\"icon ion-ios-telephone\"></i>\n      </div>\n    </div>\n  </div>\n  <!-- END OF VIDEO CALL -->\n\n  <!-- AUDIO CALL -->\n  <div ng-show=\"ctrl.is_audio_call && ctrl.fullscreen\">\n    <div class=\"phe-videocall-header\">\n      <div class=\"phe-video-call-header-right phe-video-call-chat\" ng-click=\"ctrl.toggle_fullscreen()\">\n        <i class=\"ion ion-chatbox-working\"></i>\n        <span ng-if=\"ctrl.badge_number > 0\" class=\"badge badge-assertive mini\" id=\"badge\">{{ctrl.badge_number}}</span>\n      </div>\n    </div>\n\n    <div class=\"phe-videocall-caller-image\">\n      <phe-avatar ng-if=\"ctrl.is_audio_call\" phe-user=\"ctrl.consultant\"></phe-avatar>\n    </div>\n\n    <div class=\"phe-videocall-caller-info\">\n      <div class=\"phe-videocall-caller-name phe-text-ellipsis\">{{ctrl.consultant.presentation_name}}</div>\n      <div class=\"phe-videocall-info-duration\">\n        <timer autostart=\"false\" interval=\"1000\">{{mminutes}}:{{sseconds}}</timer>\n      </div>\n    </div>\n\n    <div class=\"phe-videocall-actions-toolbar\">\n      <div ng-class=\"{false:'phe-bg-orange'}[ctrl.micro_enabled]\" ng-click=\"ctrl.toggle_audio()\" class=\"action animated\">\n        <i ng-class=\"{true:'ion-android-microphone-off',false:'ion-android-microphone'}[ctrl.micro_enabled]\" class=\"icon\"></i>\n      </div>\n    </div>\n\n    <div class=\"phe-videocall-buttons\">\n      <div class=\"phe-videocall-button cancel assertive-bg icon ion-ios-telephone animated\" ng-class=\"{true:'zoomIn',false:'zoomOut'}[ctrl.action_pending]\" ng-click=\"ctrl.hangup()\"></div>\n    </div>\n\n  </div>\n  <!-- END OF AUDIO CALL -->\n\n  <!-- MINIMIZED AUDIO -->\n  <div ng-show=\"ctrl.is_audio_call && !ctrl.fullscreen\" ng-click=\"ctrl.toggle_fullscreen();\">\n    <div class=\"phe-videocall-caller-image\">\n      <phe-avatar ng-if=\"ctrl.is_audio_call\" phe-user=\"ctrl.consultant\"></phe-avatar>\n    </div>\n  </div>\n\n</div>\n",
  "card_viewer/views/card_panel.tpl.html": "<div ng-if=\"panel.fields.length > 1\" class=\"item item-divider\">\n    {{panel.names | textByLocale}}\n</div>\n<div class=\"list list-inset\">\n    <div ng-repeat=\"field in panel.fields\">\n        <div ng-switch on=\"field.library_field.type\">\n\n            <!-- Input text -->\n            <div ng-switch-when=\"1\">\n                <label class=\"item item-input item-stacked-label\" ng-class=\"{'item-single': panel.fields.length == 1}\">\n                    <span class=\"input-label\">{{field.library_field.labels | textByLocale}}</span>\n                    <input ng-model=\"field.value.text\" ng-required=\"{{field.mandatory}}\" type=\"text\" placeholder=\"{{field.library_field.helps | textByLocale}}\">\n                </label>\n            </div>\n\n            <!-- Textarea -->\n            <div ng-switch-when=\"2\">\n                <label class=\"item item-input item-stacked-label\" ng-class=\"{'item-single': panel.fields.length == 1}\">\n                <span ng-if=\"panel.fields.length > 1\" class=\"input-label\">{{field.library_field.labels | textByLocale}}</span>\n                <span ng-if=\"panel.fields.length == 1\" class=\"input-label\" ng-bind-html=\"(field.library_field.labels | textByLocale) || ( field.library_field.helps | textByLocale )\"></span>\n                <textarea msd-elastic ng-model=\"field.value.text\" ng-required=\"{{field.mandatory}}\" placeholder=\"{{field.library_field.helps | textByLocale}}\"></textarea>\n                </label>\n            </div>\n\n            <!-- List Options -->\n            <div ng-switch-when=\"3\">\n                <label class=\"item item-input item-select\">\n                    <div class=\"input-label\">{{field.library_field.labels | textByLocale}}</div>\n                    <select ng-model=\"field.value.text\" convert-to-number ng-required=\"{{field.mandatory}}\">\n                        <option ng-repeat=\"option in field.library_field.options\" value=\"{{$index}}\">\n                            {{option.labels | textByLocale}}\n                        </option>\n                    </select>\n                </label>\n            </div>\n\n            <!-- Checkbox -->\n            <div ng-switch-when=\"4\">\n                <label class=\"item\">\n                    <div class=\"input-label\">{{field.library_field.labels | textByLocale}}</div>\n                    <ion-list>\n                        <ion-checkbox ng-repeat=\"option in field.library_field.options\"  ng-model=\"field.value.options[$index]\" ng-required=\"{{field.mandatory}}\">\n                            {{option.labels | textByLocale}}\n                        </ion-checkbox>\n                    </ion-list>\n                </label>\n            </div>\n\n            <!-- Input number -->\n            <div ng-switch-when=\"7\">\n                <label class=\"item item-input item-stacked-label\" ng-class=\"{'item-single': panel.fields.length == 1}\">\n                    <span class=\"input-label\">{{field.library_field.helps | textByLocale}}</span>\n                    <input ng-model=\"field.value.text\" type=\"number\" ng-required=\"{{field.mandatory}}\" placeholder=\"{{field.library_field.labels | textByLocale}}\">\n                </label>\n            </div>\n\n            <!-- Radio buttons -->\n            <div ng-switch-when=\"13\">\n                <label class=\"item\">\n                    <div class=\"input-label\">{{field.library_field.labels | textByLocale}}</div>\n                    <ion-list>\n                        <ion-radio name=\"{{field.library_field_id}}\" ng-required=\"{{field.mandatory}}\" ng-repeat=\"option in field.library_field.options\" ng-model=\"field.value.text\" value=\"{{option.value}}\">\n                            {{option.labels | textByLocale}}\n                        </ion-radio>\n                    </ion-list>\n                </label>\n            </div>\n\n        </div>\n    </div>\n</div>\n",
  "card_viewer/views/card_viewer.tpl.html": "<ion-view ng-if=\"ctrl.card_id\" class=\"page-view phe-card-viewer\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n    <button class=\"button button-icon\" ng-click=\"ctrl.back()\">\n      <i class=\"icon ion-ios-arrow-left\"></i>\n    </button>\n    <h2 class=\"title\">\n      {{ctrl.card.name}}\n    </h2>\n  </ion-header-bar>\n\n\n  <!--/////////////////-->\n  <!--Display_mode FORM-->\n  <!--/////////////////-->\n  <div ng-if=\"ctrl.card.display_mode == 'form' || !ctrl.card.display_mode\">\n\n    <!--Form-->\n    <form name=\"myForm\" scroll=\"false\">\n      <ion-content>\n\n        <ion-list >\n          <div ng-repeat=\"panel in ctrl.card.panels\" class=\"card-panel\">\n            <ng-include src=\"'card_viewer/views/card_panel.tpl.html'\"></ng-include>\n          </div>\n        </ion-list>\n      </ion-content>\n\n      <!--Button-->\n      <ion-footer-bar keyboard-attach class=\"bar\">\n        <div class=\"card-form-button\">\n          <div class=\"button-bar\">\n            <button id=\"m_save_button\" ng-disabled=\"ctrl.card_button_blocked || myForm.$invalid\" class=\"button button-positive icon ion-ios-checkmark-empty\"\n            ng-click=\"ctrl.save_card_form();\"></button>\n          </div>\n        </div>\n      </ion-footer-bar>\n\n    </form>\n  </div>\n\n\n\n  <!--///////////////////-->\n  <!--Display_mode WIZARD-->\n  <!--///////////////////-->\n  <div ng-if=\"ctrl.card.display_mode == 'wizard'\">\n\n    <ion-pane>\n      <div ng-if=\"ctrl.question_component == 'static'\" class=\"phe-card-answers-placeholder\">\n        <question-static \n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-static>\n      </div>\n\n      <div ng-if=\"ctrl.question_component != 'static'\"\n        class=\"phe-card-question-indicator\"\n        ng-show=\"ctrl.current_question < ctrl.card.fields.length\">\n        {{'question' | translate}} {{ctrl.num_questions}}/{{ctrl.max_questions}}\n      </div>\n\n      <div ng-switch=\"ctrl.question_component\">\n\n        <question-rating ng-switch-when=\"rating\"\n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-rating>\n\n        <question-slider ng-switch-when=\"slider\"\n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-slider>\n\n        <question-text ng-switch-when=\"text\"\n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-text>\n\n        <question-select ng-switch-when=\"select\"\n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-select>\n\n        <question-number ng-switch-when=\"number\"\n          field=\"ctrl.field_data\"\n          answer=\"ctrl.card_wizard_add_answer\"\n          close=\"ctrl.close_card\">\n        </question-number>\n\n      </div>\n\n    </ion-pane>\n\n  </div>\n\n</ion-view>",
  "consultant/views/card_panel.tpl.html": "<div class=\"list list-inset\">\n    <div class=\"list_items\" ng-repeat=\"field in panel.fields\">\n        <div ng-switch on=\"field.library_field.type\">\n            <div ng-switch-when=\"1\" id=\"{{field.library_field.identification}}\">\n                <label class=\"item item-input item-stacked-label\">\n                    <span class=\"input-label-presentation\"><h1>{{ctrl.consultant.presentation_name}}</h1></span>\n                    <span class=\"input-label\">{{field.library_field.labels | textByLocale}}</span>\n                    <div class=\"input-content\">{{field.value.text}}</div>\n                </label>\n            </div>\n            <div ng-switch-when=\"2\" id=\"{{field.library_field.identification}}\">\n                <label class=\"item item-input item-stacked-label\">\n                    <span class=\"input-label-presentation\"><h1>{{ctrl.consultant.presentation_name}}</h1></span>\n                    <span class=\"input-label\">{{field.library_field.labels | textByLocale}}</span>\n                    <div class=\"input-content\">{{field.value.text}}</div>\n                </label>\n            </div>\n            <div ng-switch-when=\"3\" id=\"{{field.library_field.identification}}\">\n                <label class=\"item item-input item-select\">\n                    <span class=\"input-label-presentation\"><h1>{{ctrl.consultant.presentation_name}}</h1></span>\n                    <span class=\"input-label\">{{field.library_field.labels | textByLocale}}</span>\n                    <div class=\"input-content\">{{field.value.text}}</div>\n                </label>\n            </div>\n        </div>\n    </div>\n</div>\n",
  "consultant/views/consultant_profile.tpl.html": "<ion-view class=\"page-view\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n        <button class=\"button button-icon\" ng-click=\"ctrl.go_to_consultation_detail()\">\n            <i class=\"icon ion-ios-arrow-left\"></i>\n        </button>\n        <h2 class=\"title\">{{ ctrl.consultant.presentation_name }}</h2>\n        <div class=\"buttons\"></div>\n    </ion-header-bar>\n\n    <ion-content class=\"phe-profile\">\n        <div class=\"row row-center padding-top\">\n            <div class=\"col text-center item-avatar phe-status-{{ctrl.consultant.status_text}}\">\n                <phe-avatar class=\"avatar\" phe-user=\"ctrl.consultant\"></phe-avatar>\n            </div>\n        </div>\n\n        <ion-list ng-if=\"!ctrl.card_loading\" class=\"card-panel\">\n            <div class=\"card-profile-panel\" ng-repeat=\"panel in ctrl.card.panels\">\n                <ng-include src=\"'consultant/views/card_panel.tpl.html'\"></ng-include>\n            </div>\n        </ion-list>\n    </ion-content>\n</ion-view>\n",
  "consultation_gallery/views/gallery.tpl.html": "<ion-view class=\"page-view\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n        <button class=\"button button-icon\" ui-sref=\"consultation.consultation_home({ consultation: ctrl.consultation })\">\n            <i class=\"icon ion-ios-arrow-left\"></i>\n        </button>\n        <h2 class=\"title\">{{'gallery' | translate}}</h2>\n        <div class=\"buttons\"></div>\n    </ion-header-bar>\n\n    <ion-content class=\"phe-gallery\">\n\n        <ion-refresher pulling-text=\"{{'load_previous_resources' | translate}}\" on-refresh=\"ctrl.show_more_resources()\" spinner=\"android\"></ion-refresher>\n        <ion-list>\n        <div class=\"row phe-padding-5 phe-margin-0\">\n            <div class=\"col col-33\" ng-repeat=\"resource in ctrl.resources\" ng-click=\"ctrl.on_resource_click( resource )\">\n                <div ng-if=\"resource.type == 'video' || resource.type == 'image' || resource.type == 'pdf'\" class=\"photo\"\n                     ng-class=\"{ 'rotate90': resource.type == 'video' }\" style=\"background-image:url('{{resource.thumbnail}}')\">\n                </div>\n                <div ng-if=\"resource.type == 'word' || resource.type == 'excel' || resource.type == 'unknown'\" class=\"document\">\n                  {{resource.name}}\n                </div>\n\n                 <!-- Watermark Play -->\n                <div class=\"gallery-watermark-container\" ng-show=\"resource.type == 'video'\">\n                    <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/play_icon.svg\"></object>\n                    <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/play_icon.svg\">\n                </div>\n\n                 <!-- Watermark Doc -->\n                <div  class=\"gallery-watermark-doc\" ng-if=\"resource.type == 'word'\">\n                    <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/doc_icon.svg\"></object>\n                    <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/doc_icon.svg\">\n                </div>\n\n                <!-- Watermark Excel -->\n                <div  class=\"gallery-watermark-doc\" ng-if=\"resource.type == 'excel'\">\n                    <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/excel_icon.svg\">\n\n                    </object>\n                    <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/excel_icon.svg\">\n                </div>\n\n              <!-- Watermark PDF -->\n              <div  class=\"gallery-watermark-doc\" ng-if=\"resource.type == 'pdf'\">\n                <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/pdf_icon.svg\"></object>\n                <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/pdf_icon.svg\">\n              </div>\n\n              <!-- Watermark Unknown -->\n              <div  class=\"gallery-watermark-doc\" ng-if=\"resource.type == 'unknown'\">\n                <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/file_unknown_icon.svg\"></object>\n                <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/file_unknown_icon.svg\">\n              </div>\n            </div>\n\n        </div>\n    </ion-content>\n</ion-view>\n",
  "consultation_gallery/views/slide_app.tpl.html": "<div on-swipe-right=\"ctrl.previous_slide()\" on-swipe-left=\"ctrl.next_slide()\">\n\n    <!--**********************-->\n    <!-- Thumbnail background -->\n    <!--**********************-->\n    <img ng-hide=\"ctrl.current_resource.type == 'word' || ctrl.current_resource.type == 'excel' || ctrl.current_resource.type == 'unknown'\" ng-click=\"ctrl.do_resource_action()\"\n         class=\"phe-slide-img\" ng-src=\"{{ctrl.current_resource.thumbnail}}\" ng-class=\"{'rotate90': ctrl.current_resource.type == 'video'}\">\n\n    <!--**********************-->\n    <!-- Doc placeholder -->\n    <!--**********************-->\n    <div  ng-show=\"ctrl.current_resource.type == 'word'\"  class=\"phe-slide-placeholder\">\n        <object ng-if=\"$root.platform === 'ios'\" class=\"phe-slide-placeholder-icon\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/doc_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" class=\"phe-slide-placeholder-icon\" ng-src=\"{{$root.theme_path}}/img/doc_icon.svg\">\n        <div class=\"phe-slide-placeholder-text\">{{ctrl.current_resource.name}}</div>\n    </div>\n\n    <!--**********************-->\n    <!-- Excel placeholder -->\n    <!--**********************-->\n    <div  ng-show=\"ctrl.current_resource.type == 'excel'\"  class=\"phe-slide-placeholder\">\n        <object ng-if=\"$root.platform === 'ios'\" class=\"phe-slide-placeholder-icon\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/excel_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" class=\"phe-slide-placeholder-icon\" ng-src=\"{{$root.theme_path}}/img/excel_icon.svg\">\n        <div class=\"phe-slide-placeholder-text\">{{ctrl.current_resource.name}}</div>\n    </div>\n\n    <!--***************-->\n    <!-- Resource actions (hide when is downloaded image)-->\n    <!--***************-->\n    <div ng-click=\"ctrl.do_resource_action()\" ng-hide = \"ctrl.current_resource.type == 'image'  && !ctrl.downloading_resource\" class=\"slide-container-loading\">\n\n        <!--************************-->\n        <!-- Stop download resource -->\n        <!--************************-->\n        <div ng-show=\"ctrl.downloading_resource\" class=\"slide-stop\">\n            <object ng-if=\"$root.platform === 'ios'\" width=\"26px\" height=\"26px\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/stop_icon.svg\">\n\n            </object>\n            <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/stop_icon.svg\" width=\"26px\" height=\"26px\" alt=\"stop_icon\">\n        </div>\n        <!--***************-->\n        <!-- Play resource -->\n        <!--***************-->\n        <div ng-show=\"!ctrl.downloading_resource\" class=\"slide-play\">\n            <object ng-if=\"$root.platform === 'ios'\" width=\"26px\" height=\"26px\" ng-show=\"ctrl.current_resource.type == 'video'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/play_icon.svg\">\n\n            </object>\n            <img ng-if=\"$root.platform !== 'ios'\" ng-show=\"ctrl.current_resource.type == 'video'\" ng-src=\"{{$root.theme_path}}/img/play_icon.svg\" width=\"26px\" height=\"26px\" alt=\"play_icon\">\n            <object ng-if=\"$root.platform === 'ios'\" width=\"26px\" height=\"26px\" ng-show=\"ctrl.current_resource.type != 'video'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/loupe_icon.svg\">\n\n            </object>\n            <img ng-if=\"$root.platform !== 'ios'\" ng-show=\"ctrl.current_resource.type != 'video'\" src=\"{{$root.theme_path}}/img/loupe_icon.svg\" width=\"26px\" height=\"26px\" alt=\"loupe_icon\">\n        </div>\n\n        <!--***************-->\n        <!-- Progress circle -->\n        <!--***************-->\n        <round-progress\n          max=\"loadingTotal\"\n          current=\"loadingStatus\"\n          color=\"#505050\"\n          bgcolor=\"#dedede\"\n          radius=\"40\"\n          stroke=\"4\"\n          semi=\"false\"\n          rounded=\"true\"\n          clockwise=\"true\"\n          responsive=\"false\"\n          duration=\"800\"\n          animation=\"easeInOutQuart\"\n          animation-delay=\"200\">\n      </round-progress>\n    </div>\n  </div>\n",
  "consultation_gallery/views/slide_browser.tpl.html": "<div class=\"slide-container\">\n\n  <!-- ***** -->\n  <!-- Video -->\n  <!-- ***** -->\n  <div ng-if=\"ctrl.current_resource.type === 'video'\">\n    <div class=\"slide-video\">\n      <video src=\"{{ctrl.current_resource.url | trustUrl}}\" autobuffer controls autoplay preload></video>\n    </div>\n  </div>\n\n  <div ng-if=\"ctrl.current_resource.type === 'pdf' || ctrl.current_resource.type === 'word' || ctrl.current_resource.type === 'excel' || ctrl.current_resource.type === 'unknown'\">\n    <div class=\"slide-file-name\">\n      <p>{{ctrl.current_resource.name}}</p>\n    </div>\n  </div>\n\n  <div ng-if=\"ctrl.current_resource.type === 'pdf' || ctrl.current_resource.type === 'image'\"\n       style=\"background-image: url( '{{ctrl.current_resource.thumbnail}}' )\" class=\"slide-row-photo\">\n  </div>\n\n  <div ng-if=\"ctrl.current_resource.type === 'word' || ctrl.current_resource.type === 'excel' || ctrl.current_resource.type === 'unknown'\"\n  class=\"slider-row-document\">\n    <img width=\"100\" ng-src=\"{{ ctrl.current_resource.thumbnail }}\">\n  </div>\n\n  <div ng-if=\"ctrl.current_resource.type === 'pdf' || ctrl.current_resource.type === 'word' || ctrl.current_resource.type === 'excel' || ctrl.current_resource.type === 'unknown'\">\n    <div class=\"slide-file-download\">\n      <button class=\"button button-icon\" ng-click=\"ctrl.play_file()\">\n        {{'download'| translate}} <i class=\"icon ion-ios-download\"></i>\n      </button>\n    </div>\n  </div>\n\n</div>\n",
  "consultation_gallery/views/slides.tpl.html": "<ion-view ng-show=\"!ctrl.loading_slide\" class=\"page-view\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n    <!--********-->\n    <!-- Header -->\n    <!--********-->\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n      <button class=\"button button-icon\" ng-click=\"ctrl.go_to_timeline()\">\n        <i class=\"icon ion-ios-arrow-left\"></i>\n      </button>\n      <div class=\"slide-view-all\" ui-sref=\"consultation.consultation_gallery({consultation: ctrl.consultation_model})\">\n        {{'view_all' | translate}}\n      </div>\n    </ion-header-bar>\n\n    <ion-content scroll=\"false\" class=\"has-header has-subheader has-footer\">\n\n      <!--*********-->\n      <!-- Browser -->\n      <!--*********-->\n      <ng-include ng-if=\"ctrl.platform == 'browser'\" src=\"'consultation_gallery/views/slide_browser.tpl.html'\"></ng-include>\n\n      <!--*****-->\n      <!-- App -->\n      <!--*****-->\n      <ng-include ng-if=\"ctrl.platform != 'browser'\" src=\"'consultation_gallery/views/slide_app.tpl.html'\"></ng-include>\n\n    </ion-content>\n\n    <!--***************-->\n    <!-- Image selector-->\n    <!--***************-->\n    <ion-footer-bar scroll=\"false\" class=\"bar bar-footer\">\n      <div class=\"slider-selector-container\">\n        <div class=\"slicer-selector-item\" ng-repeat=\"resource in ctrl.resources\" ng-click=\"ctrl.go_to_slide( $index )\">\n          <div class=\"slider-selector-img\" ng-class=\"{'slider-border': resource.type == 'pdf', 'rotate90': resource.type == 'video', 'slide-active': $index === ctrl.position}\"  style=\"background-image:url('{{resource.thumbnail}}')\">\n          </div>\n        </div>\n      </div>\n    </ion-footer-bar>\n</ion-view>\n",
  "consultation/views/action_sheet.tpl.html": "<ion-modal-view class=\"phe-action-sheet\">\n\n  <ion-header-bar class=\"bar bar-header\">\n    <button class=\"button button-clear button-primary\" ng-click=\"ctrl.close_action_sheet()\">\n      <span class=\"icon ion-android-close\"></span>\n    </button>\n  </ion-header-bar>\n\n  <ion-content scroll=\"false\" ng-hide=\"subaction\">\n    <ul class=\"row responsive-lm\">\n      <li class=\"col\">\n        <button class=\"button button-icon icon ion-image\" ng-click=\"ctrl.next_action_sheet( 'image' );\">\n          <span class=\"button-text\">{{'photo' | translate}}</span>\n        </button>\n      </li>\n      <li class=\"col\">\n        <button class=\"button button-icon icon ion-ios-film\" ng-click=\"ctrl.next_action_sheet( 'video' );\">\n          <span class=\"button-text\">{{'video' | translate}}</span>\n        </button>\n      </li>\n      <li class=\"col\" ng-if=\"ctrl.platform === 'browser'\">\n        <button class=\"button button-icon icon ion-document\" ng-click=\"ctrl.do_media_action( 'pick_media_document' );\">\n          <span class=\"button-text\">{{'document' | translate}}</span>\n        </button>\n      </li>\n    </ul>\n  </ion-content>\n\n  <ion-content scroll=\"false\" ng-show=\"subaction\">\n    <ng-switch on=\"subaction\">\n      <div ng-switch-when=\"image\">\n        <ul class=\"row responsive-lm\">\n          <li class=\"col\">\n            <button class=\"button button-icon icon ion-ios-folder\" ng-click=\"ctrl.do_media_action( 'pick_media_image' );\">\n              <div class=\"button-text\">{{'choose_file' | translate}}<br>\n                <small translate=\"max_size_info\" translate-values=\"{max: '{{ctrl.max_size_MB}}'}\"></small>\n              </div>\n            </button>\n          </li>\n          <li class=\"col\" ng-if=\"ctrl.platform !== 'browser'\">\n            <button class=\"button button-icon icon ion-ios-camera\" ng-click=\"ctrl.do_media_action( 'capture_media_image' );\">\n              <div class=\"button-text\">{{'take_photo' | translate}}</div>\n            </button>\n          </li>\n        </ul>\n      </div>\n      <div ng-switch-when=\"video\">\n        <ul class=\"row responsive-lm\">\n          <li class=\"col\">\n            <button class=\"button button-icon icon ion-ios-film\" ng-click=\"ctrl.do_media_action( 'pick_media_video' );\">\n              <div class=\"button-text\">{{'choose_file' | translate}}<br>\n                <small translate=\"max_size_info\" translate-values=\"{max: '{{ctrl.max_size_MB}}'}\"></small>\n              </div>\n            </button>\n          </li>\n          <li class=\"col\" ng-if=\"ctrl.platform !== 'browser'\">\n            <button class=\"button button-icon icon ion-ios-videocam\" ng-click=\"ctrl.do_media_action( 'capture_media_video' );\">\n              <div class=\"button-text\">{{'capture' | translate}}<br><small>({{'max_15s' | translate}})</small></div>\n            </button>\n          </li>\n        </ul>\n      </div>\n    </ng-switch>\n  </ion-content>\n\n</ion-modal-view>\n",
  "consultation/views/consultation_abstract.tpl.html": "<ion-nav-view name=\"container_home\" class=\"background_gradient\"></ion-nav-view>\n",
  "consultation/views/consultation_detail.tpl.html": "<ion-view class=\"page-view phe-page-consultation-detail\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n        <button class=\"button button-icon\" ng-click=\"ctrl.go_to_timeline()\">\n          <i class=\"icon ion-ios-arrow-left\"></i>\n        </button>\n        <h2 class=\"title\">\n          <span>{{'consultation_detail' | translate}}</span>\n          <span>&nbsp;#{{ctrl.consultation.id}}</span>\n        </h2>\n        <!--<div class=\"buttons\" ng-if=\"!ctrl.show_logout_button\">\n            <button class=\"button-clear button-positive button icon ion-log-out\" ng-click=\"ctrl.exit_phemium_app()\"></button>\n        </div>-->\n    </ion-header-bar>\n\n    <ion-content scroll=\"true\" class=\"phe-consultation-detail has-footer\" on-swipe-right=\"ctrl.go_to_timeline()\">\n      <ion-list class=\"list\">\n        <ion-item class=\"item-divider\">\n          <h2><i class=\"icon ion-information-circled\"></i>{{'information' | translate}}</h2>\n        </ion-item>\n        <ion-item class=\"phe-ws-consultation-info-box\">\n          <div class=\"phe-ws-consultation-info-box-ini-time\">\n            <div class=\"phe-ws-consultant-box-title\">{{'consultation_started' | translate}}</div>\n            <div>{{ctrl.consultation.ini_timestamp | amDateFormat: 'LLL'}}</div>\n          </div>\n          <div ng-if=\"ctrl.show_stages\" class=\"phe-ws-consultation-info-box-stage {stage_hide}\">\n            <div class=\"phe-ws-consultant-box-title\">{{'current_stage' | translate}}</div>\n            <div>{{ctrl.consultation.stage_name}}</div>\n          </div>\n        </ion-item>\n\n        <ion-item class=\"item-divider\">\n          <h2><i class=\"icon ion-ios-people\"></i>{{'participants' | translate}}</h2>\n        </ion-item>\n\n        <ion-item class=\"phe-ws-sidebar-panel-consultants\">\n          <div class=\"phe-ws-consultant-box\">\n            <div class=\"phe-ws-consultant-box-title\">{{'consultation_main_consultant' | translate}}</div>\n            <div class=\"phe-ws-consultant-box-main-avatar\">\n                <div ng-if=\"ctrl.service_profile_id == null\" class=\"consultant-status avatar-status-{{ctrl.main_consultant.status_text}}\">\n                    <phe-avatar phe-user=\"ctrl.main_consultant\"></phe-avatar>\n                </div>\n              <div ng-if=\"ctrl.service_profile_id != null\" ng-click=\"ctrl.go_to_consultant_profile()\" class=\"consultant-status avatar-status-{{ctrl.main_consultant.status_text}}\">\n                <phe-avatar phe-user=\"ctrl.main_consultant\"></phe-avatar>\n              </div>\n            </div>\n            <div class=\"phe-ws-consultant-box-name\">{{ctrl.main_consultant.presentation_name}}</div>\n            <div class=\"phe-ws-consultant-box-status\"><i class=\"icon ion-record consultant-status-{{ctrl.main_consultant.status_text}}\"></i>{{ctrl.main_consultant.status_text | translate}}</div>\n          </div>\n        </ion-item>\n\n        <ion-item ng-if=\"ctrl.other_consultants.length > 0\" class=\"phe-ws-sidebar-panel-consultants\">\n          <div class=\"phe-ws-consultant-box\">\n            <div class=\"phe-ws-consultant-box-title line\">{{'other_participants' | translate}}</div>\n            <div class=\"phe-ws-consultant-box-consultants\">\n              <div ng-repeat=\"consultant in ctrl.other_consultants\" data-id=\"consultant_{{consultant.id}}\" class=\"phe-ws-consultant-box-consultants-avatar consultant-status avatar-status-{{consultant.status_text}}\" ng-class=\"{true:'selected',false:''}[consultant.id == ctrl.selected_other_consultant.id]\" ng-click=\"ctrl.select_consultant(consultant)\">\n                <phe-avatar phe-user=\"consultant\"></phe-avatar>\n              </div>\n            </div>\n            <div data-id=\"consultant-info\" class=\"phe-ws-consultant-box-consultants-consultant animated\">\n              <div class=\"phe-ws-consultant-box-consultants-consultant-info\">\n                <div data-id=\"consultant-name\" class=\"phe-ws-consultant-box-consultants-consultant-name phe-text-ellipsis\">{{ctrl.selected_other_consultant.presentation_name}}</div>\n                <div data-id=\"consultant-status\" class=\"phe-ws-consultant-box-status\"><i class=\"icon ion-record consultant-status-{{ctrl.selected_other_consultant.status_text}}\"></i>{{ctrl.selected_other_consultant.status_text | translate}}</div>\n              </div>\n              <div ng-hide=\"ctrl.service_profile_id == null\" class=\"phe-ws-consultant-box-consultants-consultant-actions\">\n                <div data-id=\"consultant-action-profile\" class=\"phe-ws-consultant-box-consultants-consultant-action\" ng-click=\"trl.go_to_consultant_profile()\">\n                  <i class=\"icon ion-ios-information-outline\"></i>\n                  {{'profile' | translate}}\n                </div>\n              </div>\n            </div>\n          </div>\n        </ion-item>\n      </ion-list>\n    </ion-content>\n\n    <ion-footer-bar overflow-scroll=\"true\" align-title=\"center\" id=\"list-footer\">\n      <ul ng-if=\"ctrl.home_boxes.length >= 1\">\n        <li class=\"buttons\" ng-repeat=\"box in ctrl.home_boxes\" ng-click=\"ctrl.show_box( box )\">\n          <button class=\"button\">{{box.titles | textByLocale}}</button>\n        </li>\n      </ul>\n      <div id=\"phemium-version\" ng-click=\"ctrl.show_debug_info()\">Phemium V {{ctrl.branch}}</div>\n\n    </ion-footer-bar>\n\n</ion-view>",
  "consultation/views/consultation_f2f.tpl.html": "<ion-view hide-nav-bar=\"true\" ng-if=\"!ctrl.loaded\">\n  <ion-content scroll=\"true\" class=\"phe-timeline phe-timeline-c2c\">\n    <div class=\"row phe-loader-wrapper\">\n      <div class=\"col col-80 col-offset-10\">\n        <div class=\"text-center phe-call-animation\">\n          <div class=\"phone\">\n            <div class=\"circle\"></div>\n            <div class=\"circle2\"></div>\n            <div class=\"circle-fill\"></div>\n            <div class=\"circle\"></div>\n            <div class=\"circle-fill\"></div>\n            <div class=\"img-circle circle-fill\"></div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </ion-content>\n</ion-view>\n\n<ion-view hide-nav-bar=\"true\" ng-if=\"ctrl.loaded\">\n\n  <ion-nav-bar class=\"bar bar-header f2f-bar-header\" align-title=\"center\" ng-if=\"ctrl.show_exit_button\" ng-click=\"ctrl.exit()\">\n    <button class=\"button button-icon f2f-back\">\n      <i class=\"icon ion-ios-arrow-left\"></i>\n    </button>\n  </ion-nav-bar>\n\n  <ion-content hide-nav-bar=\"true\" scroll=\"true\" class=\"phe-timeline phe-timeline-c2c\">\n\n    <div class=\"row f2f-container\">\n      <div class=\"col col-80 col-offset-10\">\n\n        <div class=\"f2f-logo col text-center\">\n          <img src=\"{{$root.theme_path}}/img/login_logo.png\" ng-if=\"ctrl.show_logo\" />\n        </div>\n\n        <br/>\n\n        <!-- ********************************************** -->\n        <!-- Consultant offline -->\n        <!-- ********************************************** -->\n        <div ng-if=\"!ctrl.have_online_consultants\">\n\n          <div>\n            <h1 ng-class=\"toggle ? 'face' : 'face2'\" class=\"text-center\">{{'f2f_busy_consultants' | translate}}</h1>\n            <h2 class=\"text-center f2f-try-later\">{{'f2f_try_again_later' | translate}}</h2>\n            <h3 class=\"text-center f2f-tel\">{{'f2f_call_text' | translate}} <a ng-href=tel:{{ctrl.phone}}><strong>{{ctrl.phone}}</strong></a></h3>\n          </div>\n\n          <div class=\"text-center\">\n            <div class=\"row\">\n              <div class=\"col\">\n                <button class=\"button button-light button-full button-c2c\" ng-click=\"ctrl.retry()\" ng-if=\"!ctrl.searching\">\n                  <i class=\"icon ion-ios-contact-outline\"></i>\n                  <span>{{'f2f_try_again' | translate}}</span>\n                </button>\n\n                <button disabled class=\"button button-light button-full button-c2c\" ng-click=\"ctrl.retry()\" ng-if=\"ctrl.searching\">\n                  <i class=\"icon ion-ios-contact-outline\"></i>\n                  <span>{{'f2f_searching' | translate}}</span>\n                </button>\n              </div>\n            </div>\n          </div>\n\n        </div>\n\n\n        <!-- ********************************************** -->\n        <!-- Consultant online -->\n        <!-- ********************************************** -->\n        <div ng-if=\"ctrl.have_online_consultants\">\n\n          <div>\n            <h1 class=\"text-center\">{{'f2f_welcome_to_consultation' | translate}}</h1>\n            <h2 class=\"text-center\">{{'f2f_click_to_videocall' | translate}}</h2>\n            <h3 class=\"text-center f2f-tel\">{{'f2f_call_text' | translate}} <a ng-href=tel:{{ctrl.phone}}><strong>{{ctrl.phone}}</strong></a>\n            </h3>\n          </div>\n\n          <div ng-show=\"$root.preparing_call\" class=\"text-center phe-call-animation\">\n            <div class=\"phone\">\n              <div class=\"circle\"></div>\n              <div class=\"circle-fill\"></div>\n              <div class=\"img-circle\">\n                <i class=\"icon ion-ios-telephone-outline\"></i>\n              </div>\n            </div>\n          </div>\n\n          <div class=\"text-center\">\n            <div class=\"row\">\n              <div class=\"col\">\n                <button ng-show=\"!$root.preparing_call\" class=\"button button-light button-full button-c2c\" ng-click=\"ctrl.call()\">\n                  <i class=\"icon ion-ios-telephone-outline\"></i>\n                  <span>{{'f2f_videocall' | translate}}</span>\n                </button>\n              </div>\n            </div>\n          </div>\n\n          <div class=\"f2f-secondary-logo col text-center\" ng-if=\"ctrl.show_logo_footer\">\n            <img src=\"{{$root.theme_path}}/img/login_second_logo.png\"/>\n          </div>\n\n        </div>\n\n\n      </div>\n    </div>\n\n  </ion-content>\n\n</ion-view>\n\n",
  "consultation/views/consultation_home.tpl.html": "<ion-view class=\"page-view\">\n  <ion-header-bar on-touch=\"ctrl.scroll_to_top( true )\" class=\"bar bar-header\" align-title=\"center\" ng-show=\"ctrl.show_header\">\n\n    <!--Home button-->\n    <button class=\"button button-icon\" ng-if=\"ctrl.show_home_button && !ctrl.show_back_button && !$root.isCalling\"\n      ng-click=\"ctrl.exit_timeline( $event , 'exit')\">\n      <i class=\"icon\" ng-class=\"ctrl.backward_from_plugin_to_app_icon\"></i><br>\n      <span ng-if=\"ctrl.backward_from_plugin_to_app_icon == 'ion-home'\">Home</span>\n    </button>\n\n    <!--Back button-->\n    <button class=\"button button-icon\" ng-if=\"ctrl.show_back_button && !$root.isCalling\"\n      ng-click=\"ctrl.exit_timeline( $event , 'consultations_list' )\">\n      <i class=\"icon ion-ios-arrow-left\"></i>\n    </button>\n\n    <!-- Consultation header info -->\n    <div class=\"avatars-header phe-text-ellipsis\">\n      <!--Avatar image-->\n      <div class=\"avatars\">\n        <div class=\"avatar-wrapper\" ng-repeat=\"consultant in ctrl.header_avatars\">\n          <phe-avatar phe-user=\"consultant\"></phe-avatar>\n          <div class=\"status avatar-status-{{consultant.status_text}}\"></div>\n        </div>\n      </div>\n\n      <!--Service and Consultant Name-->\n      <div class=\"content phe-text-ellipsis\">\n        <div class=\"service-title phe-text-ellipsis\">{{ctrl.header_title}}</div>\n        <div class=\"participants-names phe-text-ellipsis\">{{ctrl.header_participants_names}}</div>\n      </div>\n    </div>\n\n    <!--Go to detail button-->\n    <div class=\"buttons\" ng-if=\"!$root.isCalling\">\n      <button class=\"button-clear button-positive button icon ion-ios-information-outline\"\n        on-touch=\"ctrl.go_to_detail()\"></button>\n    </div>\n\n  </ion-header-bar>\n\n  <div class=\"phe-toast-container\" >\n    <toast></toast>\n  </div>\n\n  <ion-content\n    data-id=\"consultation-home-content\"\n    scroll=\"true\"\n    delegate-handle=\"timeline\"\n    class=\"has-header has-footer phe-timeline\"\n    ng-class=\"{'question-chatbot-opened' : ctrl.show_dialog_question_over_footer === true}\">\n\n    <ion-refresher pulling-text=\"{{'load_previous_messages' | translate}}\" on-refresh=\"ctrl.show_more_items()\" spinner=\"android\"></ion-refresher>\n    <ion-list>\n      <phe-timeline ng-if=\"ctrl.consultation_ready\" consultation=\"ctrl.consultation_model\"></phe-timeline>\n    </ion-list>\n\n  </ion-content>\n\n  <!-- Question component -->\n  <phe-question></phe-question>\n\n  <!-- Enrich text (At this moment we only allow enrich text options in the Web App due to usability problems in App's -->\n  <div id=\"improve\" class=\"phe-conversation-panel-improve-text\" ng-class=\"{'actions-show': ctrl.writing_message}\" ng-show=\"!ctrl.is_mobile\">\n    <div class=\"phe-conversation-panel-actions\">\n      <div ng-click=\"ctrl.transform_text( 'b' )\" class=\"phe-conversation-panel-action\"><span class=\"bold\">B</span></div>\n      <div ng-click=\"ctrl.transform_text( 'i' )\" class=\"phe-conversation-panel-action\"><span class=\"italic\">I</span></div>\n      <div ng-click=\"ctrl.transform_text( 'u' )\" class=\"phe-conversation-panel-action\"><span class=\"underline\">U</span></div>\n      <div ng-click=\"ctrl.on_list_text()\" class=\"phe-conversation-panel-action\"><span class=\"list\">&#9776;</span></div>\n    </div>\n  </div>\n\n  <ion-footer-bar\n    overflow-scroll=\"true\"\n    ng-if=\"ctrl.consultation_model.data.status_id !== 2 && !ctrl.read_only\"\n    keyboard-attach\n    class=\"phe-timeline-bar\">\n\n    <div class=\"item item-input\">\n\n      <!--Send image/video button-->\n      <a ng-disabled=\"\n        ctrl.m_message.length\n        || !$root.isOnline\n        || ctrl.is_uploading_file\n        || ctrl.keyboard_opened\"\n        class=\"button button-icon icon ion-ios-plus-outline\"\n        ng-click=\"ctrl.open_action_sheet()\">\n      </a>\n\n      <!--Text input-->\n      <label class=\"item-input-wrapper\">\n        <textarea\n          ng-disabled=\"!$root.isOnline\"\n          minlength=\"1\"\n          maxlength=\"1500\"\n          ng-trim=\"true\"\n          id=\"m_message\"\n          overflow-scroll=\"true\"\n          phe-enter=\"ctrl.enter()\"\n          ng-change=\"ctrl.writing();\"\n          msd-elastic ng-model=\"ctrl.m_message\"\n          placeholder=\"{{'write_message' | translate}}...\">\n        </textarea>\n    </label>\n\n      <!--Send message/call button-->\n      <div class=\"phe-timeline-bar-button\">\n         <ion-label id=\"m_send_button\" class=\"button button-icon icon ion-android-send send-button\"\n          ng-show=\"ctrl.channel_selected == 'im' || ( ctrl.channel_selected != 'im' && ctrl.m_message.length > 0 ) || ( ctrl.channel_selected != 'im' && ctrl.call_disabled )\"\n          ng-disabled=\"!$root.isOnline\"\n          ng-click=\"ctrl.send_message()\">\n        </ion-label>\n\n        <a id=\"m_call_button\" class=\"button button-icon icon phe-call\"\n          ng-class=\"ctrl.get_call_button_css()\"\n          ng-if=\"ctrl.get_call_button_status() == 'allowed' && !ctrl.m_message.length\"\n          ng-click=\"ctrl.on_call_button_click()\">\n\n          <span class=\"phe-icon\" ng-class=\"{false:'phe-icon-phone', true:'phe-icon-waiting-room'}[ctrl.in_queue]\">\n            <span ng-if=\"ctrl.pending_appointments.length > 0 && !ctrl.in_queue && !ctrl.show_recall\"\n                  class=\"badge badge-assertive\">\n              {{ctrl.pending_appointments.length}}\n            </span>\n          </span>\n        </a>\n      </div>\n    </div>\n\n  </ion-footer-bar>\n\n  <!-- *************************** -->\n  <!-- ** REOPEN CALL BAR ALERT ONLY FOR AUDIO CALLS ** -->\n  <!-- *************************** -->\n  <div class=\"bar bar-alert\" ng-if=\"$root.isCalling && ctrl.channel_selected === 'audio'\">\n    <div class=\"message message-blink\" ng-click=\"ctrl.on_reopen_call_button()\">\n      <i class=\"icon ion-ios-telephone\"></i>\n      <phe-avatar class=\"avatar\" phe-user=\"ctrl.consultant\"></phe-avatar>\n      <span>\n        {{'reopen_call' | translate}}\n      </span>\n    </div>\n  </div>\n\n  <!-- ***************************************************** -->\n  <!-- ** APPOINTMENTS AND ACCESS WAITING ROOM BAR ALERTS ** -->\n  <!-- ***************************************************** -->\n  <div class=\"bar bar-alert\" ng-if=\"!$root.isCalling && ctrl.show_top_message_bar && ctrl.top_bar_type\">\n\n    <!-- APPOINTMENT -->\n    <div class=\"message\"\n      ng-if=\"ctrl.top_bar_type === 'appointment'\" show_top_appointment_bar\n      ng-click=\"ctrl.on_call_button_click()\">\n      <i class=\"icon ion-calendar\"></i>\n      <phe-avatar class=\"avatar\" phe-user=\"ctrl.ongoing_appointment.consultant\"></phe-avatar>\n      <span>\n        {{'appointment_press_to_enter' | translate}}\n      </span>\n\n    </div>\n\n    <!-- BEFORE WAITING ROOM -->\n    <div class=\"message\" ng-click=\"ctrl.on_call_button_click()\"\n      ng-if=\"ctrl.top_bar_type === 'before_waiting_room'\">\n\n      <!-- Enter to waiting room -->\n      <div ng-if=\"!ctrl.accessing_queue\">\n        <object ng-if=\"$root.platform === 'ios'\" class=\"icon\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/waiting-room.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" class=\"icon\" ng-src=\"{{$root.theme_path}}/img/waiting-room.svg\"/>\n        <phe-avatar class=\"avatar\" phe-user=\"ctrl.consultant\"></phe-avatar>\n        <span>\n          {{'press_to_enter_queue' | translate}}\n        </span>\n      </div>\n\n      <!-- Accessing waiting room -->\n      <div ng-if=\"ctrl.accessing_queue\">\n        <object ng-if=\"$root.platform === 'ios'\" class=\"icon\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/waiting-room.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" class=\"icon\" ng-src=\"{{$root.theme_path}}/img/waiting-room.svg\"/>\n        <phe-avatar class=\"avatar\" phe-user=\"ctrl.consultant\"></phe-avatar>\n        <span>\n          {{'accessing' | translate}}\n          <span>\n            <div class=\"spinner spinner_small\">\n              <div class=\"bounce1\"></div>\n              <div class=\"bounce2\"></div>\n              <div class=\"bounce3\"></div>\n            </div>\n          </span>\n        </span>\n      </div>\n    </div>\n\n    <!-- IN WAITING ROOM -->\n    <div class=\"message warning\"\n      ng-click=\"ctrl.on_call_button_click()\"\n      ng-if=\"ctrl.top_bar_type === 'in_waiting_room'\">\n      <object class=\"icon\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/waiting-room.svg\">\n\n      </object>\n      <img ng-if=\"$root.platform !== 'ios'\" class=\"icon\" ng-src=\"{{$root.theme_path}}/img/waiting-room.svg\"/>\n      <phe-avatar class=\"avatar\" phe-user=\"ctrl.consultant\"></phe-avatar>\n      <span>\n        {{'in_queue_message'| translate}}\n      </span>\n    </div>\n\n  </div>\n\n  <!-- *************************************** -->\n  <!-- CAMERA/MIC AND NOTIFICATION PERMISSIONS -->\n  <!-- *************************************** -->\n  <div class=\"bar bar-alert\" ng-show=\"ctrl.media_access_allowed === false || ctrl.notifications_permissions === false\">\n    <div class=\"message error\"  ng-click=\"ctrl.show_permissions_alert();\">\n      <i class=\"icon ion-alert\"></i>\n      <span>\n        {{ ctrl.permissions_alert_body }}\n      </span>\n    </div>\n  </div>\n\n  <!-- ********************************* -->\n  <!-- CONSULTANT AVAILABILITY BAR ALERT -->\n  <!-- ********************************* -->\n  <div class=\"bar bar-alert\" ng-show=\"ctrl.consultant_availability_alert === true && ctrl.consultant_status_ui\">\n    <div ng-show=\"ctrl.consultant_status_ui === 'consultant_not_available'\" class=\"message error\">\n      <i  class=\"icon ion-calendar\"></i>\n      <span>\n        {{ ctrl.consultant_availability }}\n      </span>\n    </div>\n    <div ng-show=\"ctrl.consultant_status_ui === 'consultant_not_online'\" class=\"message error\">\n      <i class=\"icon ion-alert\"></i>\n      <span>\n        {{ ctrl.consultant_status_ui | translate}}\n      </span>\n    </div>\n  </div>\n\n  <!-- ******************* -->\n  <!-- Question Components -->\n  <!-- ******************* -->\n\n  <div ng-hide=\"ctrl.waiting_to_open_question\" ng-switch=\"ctrl.show_question_component\">\n\n     <!--------------------------------->\n     <!-- Generic Question Components -->\n     <!--------------------------------->\n    <question-rating ng-switch-when=\"rating\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-rating>\n\n    <question-slider ng-switch-when=\"slider\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-slider>\n\n    <question-buttons ng-switch-when=\"list_buttons\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-buttons>\n\n    <!------------------------------------->\n    <!-- Components only used in dialogs -->\n    <!------------------------------------->\n\n    <!-- TODO: Modify these components so that they are generic to be used in single\n    questions sent to the timeline or on the cards -->\n    <question-radio ng-switch-when=\"radio_question\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\"\n      style=\"width: 100%\">\n    </question-radio>\n\n    <question-appointment ng-switch-when=\"appointment_question\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-appointment>\n\n    <question-text-dialog ng-switch-when=\"text_area_question\"\n      item=\"ctrl.last_dialog_item\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-text-dialog>\n\n    <question-list ng-switch-when=\"list_question\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-list>\n\n<!--     <question-radio-list ng-switch-when=\"list_radio_question\"\n      consultation=\"ctrl.consultation_model\"\n      field=\"ctrl.question_data\"\n      close=\"ctrl.close_question_component\">\n    </question-radio-list> -->\n\n\n\n  </div>\n\n </div>\n\n</ion-view>\n\n\n",
  "consultation/views/consultations_list.tpl.html": "<ion-view class=\"page-view phe-consultation-list\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n    <button class=\"button button-icon\" ng-if=\"ctrl.show_home_button\" ng-click=\"ctrl.exit_phemium_app()\">\n      <i class=\"icon ion-home\"></i><br>{{ 'home' | translate }}\n    </button>\n\n    <h2 class=\"title\">{{ctrl.title}}</h2>\n\n    <div class=\"buttons\">\n      <button class=\"button-clear button-positive button icon ion-log-out\" ng-if=\"!ctrl.show_home_button\" on-touch=\"ctrl.logout()\"></button>\n    </div>\n  </ion-header-bar>\n\n  <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\" scroll=\"true\">\n\n    <!--Row consultations-->\n    <div class=\"col-xs-12 p-0  ml-0 mr-0\">\n\n      <div class=\"col-xs-12 col-md-6 col-lg-4 col-xl-3 phe-consultations-container\">\n        <div class=\"col-xs-12 phe-consultation-box\" ng-repeat=\"consultation in ctrl.consultations_list_ui\" ng-click=\"ctrl.goto_consultation({{consultation.id}})\">\n\n          <!--Consultation header-->\n          <div class=\"row ml-0 mr-0 phe-consultation-box-header\">\n            <div class=\"col-xs-12 p-0 consultations-info\">\n              <span class=\"phe-consultation-box-header-title\">{{consultation.service.value}}</span>\n              -\n              <span class=\"phe-consultation-box-header-subtitle\">{{ 'consultation' | translate }} #{{consultation.id}}</span>\n            </div>\n          </div>\n\n          <!--Consultation Content-->\n          <div class=\"col-xs-12  ml-0 mr-0 phe-consultation-box-content\">\n\n            <!--Consultants -->\n            <div ng-if=\"consultation.consultants.length > 0\" class=\"phe-consultation-box-content-consultants phe-avatars-summary phe-text-ellipsis\">\n              <div class=\"phe-avatars-summary-pictures\">\n                <div class=\"phe-avatars-summary-pictures-avatar-wrapper\" ng-repeat=\"consultant in consultation.consultants_for_ui.avatars\">\n                  <phe-avatar phe-user=\"consultant\"></phe-avatar>\n                  <div class=\"status avatar-status-{{consultant.status_text}}\"></div>\n                </div>\n              </div>\n\n              <div ng-if=\"consultation.consultants.length > 0\" class=\"phe-avatars-summary-content phe-text-ellipsis\">\n                <div class=\"participants-names phe-text-ellipsis\">{{consultation.consultants_for_ui.names}}</div>\n              </div>\n            </div>\n\n            <div ng-if=\"consultation.consultants.length == 0\" class=\"phe-avatars-summary-content\">{{ 'no_consultant_assigned' | translate }}</div>\n\n            <!--Date-->\n            <div class=\"consultations-date\">\n                              {{consultation.ini_timestamp | amDateFormat: \"LLL\"}}\n                            </div>\n\n          </div>\n\n        </div>\n      </div>\n\n    <ion-infinite-scroll\n      ng-if=\"ctrl.allow_more_consultations\"\n      distance=\"1%\"\n      on-infinite=\"ctrl.show_more_consultations()\"\n      immediate-check=\"false\">\n    </ion-infinite-scroll>\n\n    </ion-content>\n</ion-view>\n",
  "consultation/views/goto_android_mobile.tpl.html": "<ion-view class=\"page-view phe-goto-app\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\">\n\n    <div class=\"row\">\n      <div class=\"col col-10\"></div>\n      <div class=\"col col-80\">\n\n\n        <div id=\"text\">\n          <p>{{ 'download_app' | translate }}</p>\n          <button class=\"button button-icon\" phe-goclick=\"bootstrap/no_calls\">\n              {{'enter' | translate}} <i class=\"icon ion-ios-arrow-right\"></i>\n          </button>\n\n        </div>\n\n        <br>\n        <a target=\"_blank\" href=\"https://play.google.com/store/apps/details?id={{ ctrl.android_app_id }}\">\n          <img id=\"icon_store\" src=\"{{ ctrl.theme_path }}/img/icon_play.png\"/>\n        </a>\n\n\n      </div>\n      <div class=\"col col-10\"></div>\n    </div>\n\n  </ion-content>\n</ion-view>\n",
  "consultation/views/goto_android_tablet.tpl.html": "<ion-view class=\"page-view phe-goto-app\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n    <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\">\n\n        <div class=\"row\">\n            <div class=\"col col-10\"></div>\n            <div class=\"col col-80\">\n\n\n                <div id=\"text\">\n                  <p>{{ 'download_app' | translate }}</p>\n\n                    <button class=\"button button-icon\" phe-goclick=\"bootstrap/no_calls\">\n                        {{'enter' | translate}} <i class=\"icon ion-ios-arrow-right\"></i>\n                    </button>\n                </div>\n\n            </div>\n            <div class=\"col col-10\"></div>\n        </div>\n\n    </ion-content>\n</ion-view>\n",
  "consultation/views/goto_ios.tpl.html": "<ion-view class=\"page-view phe-goto-app\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\">\n\n    <div class=\"row\">\n      <div class=\"col col-10\"></div>\n      <div class=\"col col-80\">\n\n\n        <div id=\"text\">\n          <p>{{ 'download_app' | translate }}</p>\n          <button class=\"button button-icon\" phe-goclick=\"bootstrap/no_calls\">\n              {{'enter' | translate}} <i class=\"icon ion-ios-arrow-right\"></i>\n          </button>\n\n        </div>\n\n        <br>\n        <a target=\"_blank\" href=\"https://itunes.apple.com/{{ ctrl.language_code }}/app/id{{ ctrl.ios_app_id }}\">\n          <img id=\"icon_store\" src=\"{{ ctrl.theme_path }}/img/icon_store.png\"/>\n        </a>\n\n\n      </div>\n      <div class=\"col col-10\"></div>\n    </div>\n\n  </ion-content>\n</ion-view>\n",
  "consultation/views/home_box.tpl.html": "<ion-modal-view class=\"phe-home-box\">\n  <div class=\"phe-home-box-content-wrapper\">\n    <div class=\"phe-home-box-icon\">\n      <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/home_box_icon.svg\"></object>\n      <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/home_box_icon.svg\" />\n    </div>\n    <div class=\"phe-home-box-title\">{{box.titles | textByLocale}}</div>\n    <div class=\"phe-home-box-content\">{{box.contents | textByLocale}}</div>\n    <div class=\"phe-home-box-button\" ng-click=\"close()\">{{'close' | translate}}</div>\n  </div>\n</ion-modal-view>\n",
  "consultation/views/items/item_type_action_request.tpl.html": "<div ng-click=\"ctrl.open_FSW(item_ui)\">\n  <span class=\"phe-circle-icon icon ion-clipboard\"></span>\n  <div class=\"phe-title\">\n    {{item_ui.data.data.card.value}}\n    </br>\n    <div class=\"phe-second-title\">\n      {{item_ui.data.description}}\n    </div>\n    <div class=\"phe-second-title\">\n      {{item_ui.data.description}}\n    </div>\n  </div>\n  <div class=\"phe-item-actions\">\n    <a class=\"button icon-right button-light ion-ios-redo\" >&nbsp; Action</a>\n  </div>\n</div>",
  "consultation/views/items/item_type_appointment_request.tpl.html": "<div ng-click=\"ctrl.open_appointment_request()\">\n  <span class=\"phe-item-date-wrap\">\n    <span class=\"phe-item-time\">{{ ctrl.item.data.creation_timestamp | amDateFormat: \"LT\" }}</span>\n    <i class=\"icon {{ctrl.custom.status_icon}}\" ng-hide=\"ctrl.item.is_from_system\"></i>\n  </span>\n  <div class=\"phe-item-type-appointment-wrapper {{status_css_class}}\">\n    <div class=\"phe-item-type-appointment-title\">\n      <span class=\"icon ion-clock phe-green\"></span>\n      <span>{{ 'appointment_scheduled' | translate }}</span>\n    </div>\n    <div class=\"phe-item-type-appointment-date\">\n      <div class=\"phe-item-type-appointment-date-info\">\n        {{ ctrl.item.appointment_text}}\n      </div>\n    </div>\n  </div>\n</div>",
  "consultation/views/items/item_type_appointment.tpl.html": "<!-- **************** -->\n<!-- **** HEADER **** -->\n<!-- **************** -->\n\n<div class=\"timeline-item-porposal-header {{ctrl.status_css_class}}\">\n    <!-- <span class=\"icon ion-clock {{ctrl.status_css_color}}\"></span> -->\n    <span>{{ 'appointment_scheduled' | translate }}</span>\n  </div>\n\n  <!-- ********************** -->\n  <!-- **** MAIN CONTENT **** -->\n  <!-- ********************** -->\n\n  <div class=\"row phe-margin-0\">\n\n    <!-- **** LEFT COLUMN **** -->\n    <div class=\"col col-50 timeline-item-porposal-left-column\">\n      <!-- Day -->\n      <span class=\"timeline-item-proposal-day\">\n        {{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'D' }}\n      </span>\n      <!-- Month -->\n      <span>\n        {{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'MMMM' }}\n      </span>\n    </div>\n\n    <!-- **** RIGHT COLUMN **** -->\n    <!-- Hour -->\n    <div class=\"col col-50 timeline-item-porposal-right-column\">\n      <span>{{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'HH:mm' }}</span>&nbsp;h\n    </div>\n  </div>\n\n  <!-- ************************ -->\n  <!-- ** TIMELINE ITEM HOUR  **-->\n  <!-- ************************ -->\n\n  <div ng-hide=\"ctrl.item.data.status == 1\" class=\"item-timeline-date-absolute\">\n    <span>{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    <i class=\"icon {{ctrl.item.custom.status_icon}}\" ng-hide=\"ctrl.item.custom.is_from_system\"></i>\n  </div>\n",
  "consultation/views/items/item_type_call.tpl.html": "<div>\n\n    <!-- Header -->\n    <div class=\"timeline-item-header\" ng-if=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n        <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n    </div>\n\n    <!-- Missed Call -->\n    <div ng-if=\"ctrl.item.data.data.duration == '0'\" class=\"timeline-item-call-content\">\n      <object ng-if=\"$root.platform === 'ios'\" class=\"phe-icon-missed-call\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_missed_call.svg\">\n\n      </object>\n      <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/icon_missed_call.svg\" class=\"phe-icon-missed-call\">\n      <span>{{'missed_call' | translate}}</span>\n    </div>\n\n    <!-- Call -->\n    <div ng-if=\"ctrl.item.data.data.duration > '0'\">\n        <object ng-if=\"$root.platform === 'ios'\" class=\"phe-icon-call\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_call.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/icon_call.svg\" class=\"phe-icon-call\">\n        <div>\n\n          <!-- Text -->\n          {{'has_called' | translate}} <br>\n          {{ctrl.item.data.data.to.value}}\n\n          <!-- Call Duration -->\n          <div class=\"phe-item-type-call-extra\" ng-if=\"ctrl.item.data.data.duration > 0\">\n            <span ng-if=\"ctrl.item.data.data.duration > 0\" class=\"phe-text-ellipsis\">{{'duration' | translate}}: {{ctrl.item.data.data.duration | amDateFormat:'mm:ss'}} s</span>\n          </div>\n        </div>\n    </div>\n\n  <span class=\"item-timeline-date-absolute\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n</div>",
  "consultation/views/items/item_type_cancelled_consultation.tpl.html": "<i class=\"icon ion-ios-eye\"></i>\n<span>{{'consultation_canceled' | translate}}</span>\n<span class=\"phe-item-system-subtitle\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n",
  "consultation/views/items/item_type_card_changes.tpl.html": "<div>\n    <object ng-if=\"$root.platform === 'ios'\" class=\"phe-icon-form\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_form.svg\">\n\n    </object>\n    <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/icon_form.svg\" class=\"phe-icon-form\">\n  <!-- Simple Card Field Values -->\n  <div class=\"phe-inline\" ng-if=\"ctrl.item.data.data.simple_card_field_value\">\n    {{ctrl.item.data.data.simple_card_field_value.card_library_field.labels | textByLocale}}: {{ctrl.item.data.data.simple_card_field_value.text}}\n    <span class=\"item-timeline-date-inline\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n  </div>\n\n  <!-- Several Card Field Values -->\n  <div ng-if=\"!ctrl.item.data.data.simple_card_field_value\">\n    <div class=\"phe-inline\" translate=\"modified_card\" translate-values=\"{name_card: ctrl.item.data.data.card.value, name: ctrl.item.data.data.from.value}\"> </div>\n    <span class=\"item-timeline-date-inline\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n  </div>\n</div>",
  "consultation/views/items/item_type_card.tpl.html": "<!-- Header -->\n<div class=\"timeline-item-header\"  ng-if=\"item_ui.custom.is_first_in_block\">\n  {{item_ui.data.data.from.value}}\n</div>\n\n<!-- Main Content -->\n<div class=\"phe-title\">\n    {{item_ui.data.data.card.value}}</br>\n    <div class=\"phe-second-title\">\n      {{item_ui.data.message}}\n    </div>\n  </div>\n\n  <!--Button to response field question item -->\n  <button>\n    <div ng-click=\"ctrl.open_card( item_ui )\">\n        {{'answer' | translate}}\n    </div>\n  </button>\n\n  <!-- ************************ -->\n  <!-- ** TIMELINE ITEM HOUR  **-->\n  <!-- ************************ -->\n\n  <div class=\"item-timeline-date-absolute\">\n    <span>{{item_ui.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    <i class=\"icon {{ctrl.item.custom.status_icon}}\"></i>\n  </div>\n\n",
  "consultation/views/items/item_type_closed_consultation.tpl.html": "<div>\n\n  <!-- Header -->\n  <div class=\"timeline-item-header\" ng-if=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n    <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n  </div>\n\n  <!-- icon -->\n  <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_ok.svg\">\n\n  </object>\n  <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/icon_ok.svg\">\n\n  <!-- Message -->\n  <span>{{'close_consultation' | translate}}</span>\n\n  <!-- Hour -->\n  <span class=\"item-timeline-date-absolute\">\n    <span ng-if=\"!ctrl.item.custom.is_from_system\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    <i class=\"icon {{ctrl.item.custom.status_icon}}\" ng-hide=\"ctrl.item.custom.is_from_system || ctrl.item.custom.is_from_consultant\"></i>\n  </span>\n\n</div>",
  "consultation/views/items/item_type_consultation_shared.tpl.html": "<phe-avatar phe-user=\"ctrl.item.data.data.consultant_added\"></phe-avatar>\n<div class=\"valign-middle\">\n    <span>{{'shared_consultation' | translate}}\n        <b>{{ctrl.item.data.data.to.value}}</b>\n    </span>\n    <!-- <span class=\"item-timeline-date-absolute\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span> -->\n    <span class=\"item-timeline-date-inline\">\n        <span>{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    </span>\n</div>",
  "consultation/views/items/item_type_field_answer.tpl.html": "\n<div class=\"answer-field-question\">\n  <div><strong>{{ctrl.item.custom.user_name}}</strong></div>\n  {{ctrl.item.custom.question_text}}\n</div>\n\n<div class=\"answer-field-answer-container\"\n     ng-if=\"ctrl.item.custom.field_type == 19\">\n  <div class=\"answer-field-answer-icon\">\n    <div class=\"optionSelected0\" ng-if=\"ctrl.item.custom.value == '1'\">\n      <div style=\"background: url( '{{$root.theme_path + '/img/face1.svg'}}' ) no-repeat center; height: 72px; position: relative;\"></div>\n    </div>\n    <div class=\"optionSelected1\" ng-if=\"ctrl.item.custom.value == '2'\">\n      <div style=\"background: url( '{{$root.theme_path + '/img/face2.svg'}}' ) no-repeat center; height: 72px; position: relative;\"></div>\n    </div>\n    <div class=\"optionSelected2\" ng-if=\"ctrl.item.custom.value == '3'\">\n      <div style=\"background: url( '{{$root.theme_path + '/img/face3.svg'}}' ) no-repeat center; height: 72px; position: relative;\"></div>\n    </div>\n  </div>\n  <div class=\"answer-field-answer-text\">\n    <div class=\"optionSelected0\" ng-if=\"ctrl.item.custom.value == '3' \">{{ctrl.item.custom.value_text}}</div>\n    <div class=\"optionSelected1\" ng-if=\"ctrl.item.custom.value == '2' \">{{ctrl.item.custom.value_text}}</div>\n    <div class=\"optionSelected2\" ng-if=\"ctrl.item.custom.value == '1' \">{{ctrl.item.custom.value_text}}</div>\n  </div>\n</div>\n\n<div class=\"answer-field-answer-container-combo\" ng-if=\"ctrl.item.custom.field_type != 19\">\n  <p>{{ctrl.item.custom.value_text}}</p>\n</div>\n\n<!-- ************************ -->\n<!-- ** TIMELINE ITEM HOUR  **-->\n<!-- ************************ -->\n\n<div class=\"item-timeline-date-absolute\">\n    <span>{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    <i class=\"icon {{ctrl.item.custom.status_icon}}\"></i>\n  </div>",
  "consultation/views/items/item_type_field_question.tpl.html": "<!-- Header -->\n<div class=\"timeline-item-header\" ng-show=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n  <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n</div>\n\n<div>\n  {{ctrl.item.data.data.labels[0].value}}\n</div>\n\n<!--Button to response field question item -->\n<button>\n  <!-- Question STATUS_UNANSWERED -->\n  <div ng-if=\"ctrl.item.data.status == 1\" ng-click=\"ctrl.open_question( ctrl.item )\">\n    Contestar\n  </div>\n  <!-- Question STATUS_ANSWERED -->\n  <div ng-if=\"ctrl.item.data.status != 1\">\n    Contestado\n  </div>\n</button>\n\n<!-- ************************ -->\n<!-- ** TIMELINE ITEM HOUR  **-->\n<!-- ************************ -->\n\n<div class=\"item-timeline-date-absolute\">\n  <span>{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n  <i class=\"icon {{ctrl.item.custom.status_icon}}\"></i>\n</div>",
  "consultation/views/items/item_type_file.tpl.html": "<!-- ****************************** -->\n<!-- SEVERAL RESOURCES OR ONE IMAGE -->\n<!-- ****************************** -->\n\n<div ng-if=\"!ctrl.compact_layout_mode\" class=\"phe-flex-container phe-margin-0 phe-padding-0\">\n\n  <div ng-repeat=\"resource in ctrl.data.resources\"\n    class=\"col phe-margin-0 phe-padding-0\"\n    ng-class=\"{'col-50': ctrl.data.resources.length > 1}\">\n\n    <!-- Container. With border for document files-->\n    <div ng-click=\"ctrl.on_resource_click( $index )\"\n      class=\"phe-container-ratio4-3\"\n      ng-class=\"{'item-file-with-border': ( resource.type == 'excel' || resource.type == 'word' || resource.type == 'unknown')}\">\n\n      <!-- Image. Only for images, videos and PFD -->\n      <div ng-if=\"resource.type == 'pdf' || resource.type == 'image' || resource.type == 'video'\"\n        class=\"item-file-image phe-content-ratio-containers\"\n        ng-class=\"{ 'rotate90': resource.type == 'video' }\"\n        style=\"background-image: url( '{{resource.thumbnail}}' )\"></div>\n\n      <!-- Watermark play -->\n      <div class=\"watermark-container\" ng-if=\"resource.watermark_type === 'play'\">\n        <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/play_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/play_icon.svg\">\n      </div>\n\n      <!-- Watermark Doc -->\n      <div class=\"watermark-doc\" ng-if=\"resource.type === 'word'\">\n        <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/doc_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/doc_icon.svg\">\n      </div>\n\n      <!-- Watermark Excel -->\n      <div class=\"watermark-doc\" ng-if=\"resource.type === 'excel'\">\n        <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/excel_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/excel_icon.svg\">\n      </div>\n\n      <!-- Watermark Unknown -->\n      <div class=\"watermark-doc\" ng-if=\"resource.type === 'unknown'\">\n        <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/file_unknown_icon.svg\">\n\n        </object>\n        <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/file_unknown_icon.svg\">\n      </div>\n\n      <!--***************-->\n      <!-- Progress circle -->\n      <!--***************-->\n      <div class=\"watermark-container phe-background-none\" ng-show=\"resource.watermark_type === 'uploading'\">\n        <div class=\"upload-progress-container\">\n          <round-progress\n            max=\"loadingTotal\"\n            current=\"loadingStatus\"\n            color=\"#505050\"\n            bgcolor=\"#dedede\"\n            radius=\"40\"\n            stroke=\"4\"\n            semi=\"false\"\n            rounded=\"true\"\n            clockwise=\"true\"\n            responsive=\"false\"\n            duration=\"800\"\n            animation=\"easeInOutQuart\"\n            animation-delay=\"200\">\n          </round-progress>\n        </div>\n      </div>\n\n      <!-- Retry -->\n      <div class=\"watermark-retry bt-refresh\" ng-if=\"resource.watermark_type === 'retry'\"></div>\n      <div class=\"file-error bt-error\" ng-if=\"resource.watermark_type === 'retry'\"></div>\n\n      <!-- File validations -->\n      <!--div class=\"phe-item-validation phe-item-validation-{{ resource.validation_status }}\"></div -->\n\n    </div>\n  </div>\n</div>\n\n\n<!-- ******************************** -->\n<!-- ONE FILE TYPE WORD, EXCEL OR PDF -->\n<!-- ******************************** -->\n\n<div  ng-click=\"ctrl.on_resource_click( 0 )\" ng-if=\"ctrl.compact_layout_mode\" class=\"timeline-item-file-compact-mode-box\">\n\n  <!-- Header -->\n  <div class=\"timeline-item-header\" ng-if=\"ctrl.item_ui.custom.item_from == 'consultant' && ctrl.item_ui.custom.is_first_in_block\">\n    <span>{{ctrl.item_ui.custom.consultant.consultant.presentation_name}}</span>\n  </div>\n\n  <div class=\"timeline-item-file-compact-mode-content\">\n    <!-- Watermark Doc -->\n    <div class=\"watermark-doc-compact-mode\" ng-if=\"ctrl.data.resources[0].type === 'word'\">\n      <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/doc_icon.svg\">\n\n      </object>\n      <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/doc_icon.svg\">\n    </div>\n\n    <!-- Watermark Excel -->\n    <div class=\"watermark-doc-compact-mode\" ng-if=\"ctrl.data.resources[0].type === 'excel'\">\n      <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/excel_icon.svg\">\n\n      </object>\n      <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/excel_icon.svg\">\n    </div>\n\n    <!-- Watermark Unknown -->\n    <div class=\"watermark-doc-compact-mode\" ng-if=\"ctrl.data.resources[0].type === 'unknown'\">\n      <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/file_unknown_icon.svg\">\n\n      </object>\n      <img ng-if=\"$root.platform !== 'ios'\" ng-src=\"{{$root.theme_path}}/img/file_unknown_icon.svg\">\n    </div>\n\n    <div class=\"timeline-item-file-name\">\n      {{ctrl.data.resources[0].name}}\n    </div>\n    {{ctrl.data.resources[0].size}} MB\n\n  </div>\n\n</div>\n\n<!-- Message -->\n<div class=\"\" ng-if=\"ctrl.data.message\">\n  {{ctrl.data.message}}\n</div>\n<div class=\"item-timeline-date-absolute timestamp-resources\">\n  <span ng-if=\"!ctrl.data.is_from_system\">{{ctrl.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n  <i class=\"icon {{ctrl.item.custom.status_icon}}\" ng-hide=\"ctrl.data.is_from_system || ctrl.data.is_from_consultant\"></i>\n</div>\n\n\n</div>\n",
  "consultation/views/items/item_type_message.tpl.html": "<div>\n  <!-- Header -->\n  <div class=\"timeline-item-header\" ng-if=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n    <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n  </div>\n  <!-- Message -->\n  <span ng-bind-html=\"::ctrl.item.data.message\"></span>\n  <!-- Hour -->\n  <span class=\"item-timeline-date-inline\">\n    <span ng-if=\"!ctrl.item.custom.is_from_system\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n    <i class=\"icon {{ctrl.item.custom.status_icon}}\" ng-hide=\"ctrl.item.custom.is_from_system || ctrl.item.custom.is_from_consultant\"></i>\n  </span>\n</div>\n",
  "consultation/views/items/item_type_proposal.tpl.html": "<!-- **************** -->\n<!-- **** HEADER **** -->\n<!-- **************** -->\n\n<div class=\"timeline-item-porposal-header {{ctrl.status_css_class}}\">\n  <!-- <span class=\"icon ion-clock {{ctrl.status_css_color}}\"></span> -->\n  <span>{{ ctrl.status_text }}</span>\n</div>\n\n<!-- ********************** -->\n<!-- **** MAIN CONTENT **** -->\n<!-- ********************** -->\n<div ng-if=\"ctrl.item.data.message\" class=\"timeline-item-proposal-message\">\n    {{::ctrl.item.data.message}}\n</div>\n\n<div class=\"row phe-margin-0\">\n\n  <!-- **** LEFT COLUMN **** -->\n  <div class=\"col col-50 timeline-item-porposal-left-column\">\n    <!-- Day -->\n    <span class=\"timeline-item-proposal-day\">\n      {{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'D' }}\n    </span>\n    <!-- Month -->\n    <span>\n      {{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'MMMM' }}\n    </span>\n  </div>\n\n  <!-- **** RIGHT COLUMN **** -->\n  <!-- Hour -->\n  <div class=\"col col-50 timeline-item-porposal-right-column\">\n    <span>{{ ctrl.item.data.data.timestamp_ini | amDateFormat: 'HH:mm' }}</span>&nbsp;h\n  </div>\n</div>\n\n<!-- ********************** -->\n<!-- ****** ACTIONS ******* -->\n<!-- ********************** -->\n\n<div class=\"timeline-item-proposal-actions row\" ng-show=\"ctrl.item.data.status == 1\" ng-class=\"{true:'processing'}[ctrl.item.custom.processing]\">\n\n  <!-- Buttons -->\n  <button class=\"col col-50 timeline-item-button\"\n    ng-click=\"ctrl.reject_proposal();\"\n    ng-hide=\"ctrl.item.custom.processing\">\n      {{ 'reject' | translate }}\n  </button>\n  <button class=\"col col-50 timeline-item-button button-important\"\n    ng-click=\"ctrl.confirm_proposal();\"\n    ng-hide=\"ctrl.item.custom.processing\">\n      {{ 'accept' | translate }}\n  </button>\n\n  <!-- Loading -->\n  <div ng-show=\"ctrl.item.custom.processing\" class=\"phe-margin-auto\">\n      <div class=\"spinner spinner_small\">\n        <div class=\"bounce1\"></div>\n        <div class=\"bounce2\"></div>\n        <div class=\"bounce3\"></div>\n      </div>\n  </div>\n</div>\n\n<!-- ************************ -->\n<!-- ** TIMELINE ITEM HOUR  **-->\n<!-- ************************ -->\n\n<div ng-hide=\"ctrl.item.data.status == 1\" class=\"item-timeline-date-absolute\">\n  <span>{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span>\n</div>\n",
  "consultation/views/items/item_type_question.tpl.html": "<div class=\"timeline-item-question consultant\" ng-class=\"{'timeline-item-question-after-loading': ctrl.loading_processing_answer === false}\">\n  <!-- Header -->\n  <div class=\"timeline-item-header\" ng-show=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n    <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n  </div>\n\n  <!-- Loading -->\n  <div ng-show=\"ctrl.loading_processing_answer === true\" class=\"phe-padding-10\">\n\n    <div class=\"spinner spinner_small\">\n      <div class=\"bounce1\"></div>\n      <div class=\"bounce2\"></div>\n      <div class=\"bounce3\"></div>\n    </div>\n  </div>\n\n  <!-- Question -->\n  <div ng-hide=\"ctrl.loading_processing_answer === true\">\n    {{ctrl.item.data.data.texts[0].value }}\n    <br> {{ctrl.item.data.data.field.texts[0].value}}\n    <div class=\"timeline-item-question-button\" ng-show=\"ctrl.await_for_user_action && ( ctrl.pending_answer === true )\" ng-click=\"ctrl.open_question_component()\">\n      {{'answer' | translate}}\n    </div>\n    <!-- Hour -->\n    <span class=\"item-timeline-date-inline\">\n      {{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}\n    </span>\n  </div>\n\n</div>",
  "consultation/views/items/item_type_response.tpl.html": "<div>\n  <!-- Message -->\n  <span ng-bind-html=\"ctrl.item.data.data.text\"></span>\n  <!-- Hour -->\n  <span class=\"item-timeline-date-inline\">\n    {{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}\n  </span>\n</div>",
  "consultation/views/items/item_type_stage_change.tpl.html": "<i class=\"icon ion-shuffle\"></i>\n<span>\n  {{'change_stage' | translate}}\n\n  <div class=\"name_stage\">\n    {{ctrl.item.custom.stage.name}}\n  </div>\n\n</span>\n",
  "consultation/views/items/item_type_waiting_room_status.tpl.html": "<!-- Enter waiting room -->\n<div class=\"timeline-item-waiting-room-content enter-waiting-room\" ng-if=\"ctrl.item.data.status == 1\">\n  <object ng-if=\"$root.platform === 'ios'\" class=\"phe-icon-enter-waiting-room\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_enter.svg\">\n\n  </object>\n  <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/icon_enter.svg\" class=\"phe-icon-enter-waiting-room\">\n  <span>{{'entered_waiting_room' | translate}}</span>\n</div>\n<!-- Leave waiting room -->\n<div class=\"timeline-item-waiting-room-content leave-waiting-room\" ng-if=\"ctrl.item.data.status == 2\">\n  <object ng-if=\"$root.platform === 'ios'\" class=\"phe-icon-leave-waiting-room\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/icon_leave.svg\">\n\n  </object>\n  <img ng-if=\"$root.platform !== 'ios'\" src=\"{{$root.theme_path}}/img/icon_leave.svg\" class=\"phe-icon-leave-waiting-room\">\n  <span> {{'left_waiting_room' | translate}}</span>\n</div>\n<!--  <span class=\"item-timeline-date-absolute\">{{ctrl.item.data.creation_timestamp | amDateFormat: \"LT\"}}</span> -->",
  "consultation/views/items/item_type_web_request.tpl.html": "<!-- Header -->\n<div class=\"timeline-item-header\" ng-if=\"ctrl.item.custom.item_from == 'consultant' && ctrl.item.custom.is_first_in_block\">\n  <span>{{ctrl.item.custom.consultant.consultant.presentation_name}}</span>\n</div>\n\n<div ng-click=\"ctrl.open_url()\">\n\n  <div class=\"row phe-margin-0 phe-padding-0\">\n\n    <!-- Left Column Thumbnail -->\n    <div class=\"phe-files col col-33\">\n      <div class=\"phe-container-ratio3-4 phe-web-request-image\">\n          <div class=\"phe-content-ratio-containers\"\n            style=\"background-image: url('{{ctrl.web_request.image}}');\">\n          </div>\n      </div>\n    </div>\n\n    <!-- Right Column -->\n    <div class=\"col col-66\">\n\n      <!-- Title -->\n      <div class=\"phe-web-request-title\">\n          <b>{{ctrl.web_request.title}}</b>\n      </div>\n      <!-- Description -->\n      <div class=\"phe-web-request-description\" ng-bind-html=\"ctrl.web_request.description\"></div>\n\n    </div>\n  </div>\n\n  <!-- Price -->\n  <div class=\"phe-web-request-price\"  ng-show=\"ctrl.item.data.object_type == 'product'\">\n      {{ctrl.web_request.price}}\n  </div>\n\n  <!-- Button -->\n  <div class=\"phe-web-request-button\" ng-click=\"ctrl.open_url()\">\n    {{'view' | translate}}\n  </div>\n\n</div>",
  "consultation/views/pending_appointments.tpl.html": "<ion-modal-view class=\"phe-action-sheet phe-action-sheet-appointments\">\n  <ion-header-bar class=\"bar bar-header\">\n    <button class=\"button button-clear button-primary\" ng-click=\"ctrl.hide_pending_appointments_modal()\">\n      <span class=\"icon ion-android-close\"></span>\n    </button>\n  </ion-header-bar>\n  <ion-content>\n    <div class=\"list\" ng-if=\"ctrl.pending_appointments.length > 0\">\n      <div ng-repeat=\"appointment in ctrl.pending_appointments | orderBy : 'data.timestamp_ini' \"\n           class=\"phe-pending-appointments\">\n        <a class=\"item item-text-wrap item-icon-left \" href=\"#\">\n          <i class=\"icon ion-android-time\"></i>\n            <span translate=\"you_have_an_appointment_extended\"\n                  translate-values=\"{ini_date: '{{appointment.data.timestamp_ini_humanized}}', name: '{{appointment.consultant.value}}'}\">\n            </span>\n        </a>\n      </div>\n      <div class=\"phe-appointment-info\">\n        <a class=\"item item-icon-left item-text-wrap item-stable\" href=\"#\">\n          <span translate=\"waiting_room_access_period_notification\" translate-values=\"{min: '{{ctrl._appointment_before_period_as_text }}'}\"></span>\n\n        </a>\n      </div>\n    </div>\n    <div class=\"list phe-no-pending-appointments\" ng-if=\"ctrl.pending_appointments.length == 0\">\n      <a class=\"item item-icon-left item-text-wrap\" href=\"#\">\n        <i class=\"icon ion-alert-circled\"></i>\n        {{'no_appointments' | translate}}\n      </a>\n    </div>\n  </ion-content>\n</ion-modal-view>\n",
  "consultation/views/questions/question-appointment.html": "<div ng-if=\"ctrl.field\" class=\"answer-appointment-container\">\n  <div class=\"answer-radio-box\">\n    <div class=\"answer-radio-list-container\">\n      <button class=\"button button-select phe-answer-button\" ng-click=\"ctrl.open_appointment_request()\">\n        <span>{{'Select_date_and_time' | translate}}</span>\n      </button>\n    </div>\n    <!-- ACTIONS -->\n    <div ng-repeat=\"action in ctrl.item.data.data.actions\">\n        <button class=\"button button-select phe-answer-button\" ng-click=\"ctrl.save_data(ctrl.item.data.data.actions[$index]);\">\n          <span>{{ctrl.showActionValue(ctrl.item.data.data.actions, action.key)}}</span>\n        </button>\n      </div>\n  </div>\n</div>",
  "consultation/views/questions/question-buttons.html": "\n<div ng-if=\"ctrl.field\" style=\"z-index:3;\" class=\"question-container\">\n\n\n   <!--////////////////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container is full_screen or popup-->\n    <!--////////////////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}}\n    </div>\n\n\n    <!--/////////-->\n    <!--INPUT BOX-->\n    <!--/////////-->\n    <div class=\"question-rating-box\" ng-hide=\"ctrl.animations_leave_page == 'step3'\">\n\n        <!--QUESTION inside question_box when show in timeline-->\n        <div ng-if=\"ctrl.field.question_context == 'single_question'\" class=\"question_field_answers_options_header\">\n            {{ctrl.field.labels[0].value}}\n        </div>\n\n        <div class=\"row question-rating-container\">\n\n            <div class=\"row comboContainer\" style=\"padding: 15px 0 0 0;\">\n                <div class=\"comboSelection\"\n                        ng-repeat=\"answer in ctrl.question.options\"\n                        ng-click=\"ctrl.vm.question_selected_value = answer\"\n                        ng-class=\"{'optionSelectedCombo': ctrl.vm.question_selected_value == answer}\">\n                    <div class=\"combo-answer\">{{answer}}</div>\n                </div>\n            </div>\n        </div>\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\">\n                <span ng-if=\"ctrl.question_context === 'card'\">Siguiente</span>\n                <span ng-if=\"!ctrl.question_context === 'single_question'\">Guardar</span>\n            </div>\n        </div>\n\n    </div>\n\n</div>\n",
  "consultation/views/questions/question-list.html": "<div class=\"answer-list-box\">\n\n  <!-- TITLE QUESTION LIST -->\n  <div class=\"answer-list-title\">\n      {{::ctrl.field.list_title}}\n  </div>\n\n  <!-- ************ -->\n  <!-- SEARCH INPUT -->\n  <!-- ************ -->\n\n  <input type=\"text\" class=\"phe-search-input\" placeholder=\"{{ 'Search' | translate }}\" ng-model=\"searchText\">\n\n  <!-- ****************** -->\n  <!-- QUESTION LIST ITEMS-->\n  <!-- ****************** -->\n\n  <!-- OPTIONS -->\n  <div class=\"phe-question-list-box\" ng-repeat=\"field in ctrl.field.options  | filter:searchText\"\n    ng-click=\"ctrl.selectListOption(field)\">\n\n    <!-- CIRCLE SELECTED OPTION FOR TYPE LIST -->\n    <i ng-show=\"ctrl.field.type === 'REMOTE_LIST'\" class=\"phe-list-icon icon\"\n      ng-class=\"{true: 'ion-ios-circle-filled selected', false: 'ion-ios-circle-outline'} [field.id == ctrl.selected_item.id]\">\n    </i>\n    <!-- CIRCLE SELECTED OPTION FOR TYPE RADIO CONVERTED TO LIST (LARGE OPTIONS)-->\n    <i ng-show=\"ctrl.field.type === 'RADIO' ||ctrl.field.type === 'LIST'\"class=\"phe-list-icon icon\"\n      ng-class=\"{true: 'ion-ios-circle-filled selected', false: 'ion-ios-circle-outline'} [field.value == ctrl.selected_item.value]\">\n    </i>\n    <span class=\"phe-field-list-item\">{{::field.labels[0].value}}</span>\n  </div>\n\n  <!-- ACTIONS -->\n  <div class=\"phe-question-list-box\" ng-repeat=\"field in ctrl.field.actions  | filter:searchText\"\n    ng-click=\"ctrl.selectListOption(field)\">\n\n    <!-- CIRCLE SELECTED OPTION FOR TYPE RADIO CONVERTED TO LIST (LARGE OPTIONS)-->\n    <i class=\"phe-list-icon icon\"\n      ng-class=\"{true: 'ion-ios-circle-filled selected', false: 'ion-ios-circle-outline'} [field.key == ctrl.selected_item.key]\">\n    </i>\n    <span class=\"phe-field-list-item\">{{::field.texts[0].value}}</span>\n  </div>\n\n\n</div>\n\n  <!-- ******* -->\n  <!-- BUTTONS -->\n  <!-- ******* -->\n\n  <div class=\"phe-list-bottom-buttons\">\n      <button class=\"button button-select phe-answer-button phe-list-answer-button\" ng-click=\"ctrl.close()\">\n        <span>{{'cancel' | translate}}</span>\n      </button>\n      <button class=\"button button-select phe-answer-button phe-list-answer-button\" ng-click=\"ctrl.save_list_item()\">\n        <span>{{'accept' | translate}}</span>\n      </button>\n  </div>",
  "consultation/views/questions/question-number.html": "<div ng-if=\"ctrl.field\" class=\"question-container\">\n\n\n    <!--////////////////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container is full_screen or popup-->\n    <!--////////////////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}}\n    </div>\n\n\n    <!--/////////-->\n    <!--INPUT BOX-->\n    <!--/////////-->\n    <div class=\"question-rating-box\" ng-hide=\"ctrl.animations_leave_page\">\n\n        <!--QUESTION inside question_box when show in timeline-->\n        <div ng-if=\"ctrl.field.question_context == 'single_question'\" class=\"question_field_answers_options_header\">\n            {{ctrl.field.labels[0].value}}\n        </div>\n\n        <div class=\"row question-rating-container\">\n            <div keyboard-attach class=\"item-input question-input-number\">\n                <label class=\"item-input-wrapper\" style=\"background: none;\">\n                    <input class=\"input-rounded\" type=\"number\" placeholder=\"{{'write_message' | translate}}...\" ng-model=\"ctrl.question_value\" style=\"border-radius: 5px !important;border:1px solid rgb(103, 103, 103) !important; padding: 10px !important; \">\n                </label>\n            </div>\n            <div keyboard-attach class=\"question-input-number-unit\">\n              {{ ctrl.field.data.units }}\n            </div>\n        </div>\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\"  ng-disabled=\"ctrl.question_value == ''\">\n                <span ng-if=\"ctrl.field.question_context === 'card' && !ctrl.field.is_last_question\">Siguiente</span>\n                <span ng-if=\"ctrl.field.question_context === 'single_question' || ctrl.field.is_last_question\">Guardar</span>\n            </div>\n        </div>\n    </div>\n</div>",
  "consultation/views/questions/question-radio-list.html": "<!-- Radio button bar to open list or other options -->\n<div ng-if=\"ctrl.field\" class=\"question-radio-list-container\">\n  <div class=\"answer-radio-box\">\n    <div class=\"answer-radio-list-container\">\n      <button class=\"button-select phe-radio-button\" ng-click=\"ctrl.open_list()\">\n        <span>{{'Select' | translate}}</span>\n      </button>\n    </div>\n    <!-- ACTIONS -->\n    <div ng-repeat=\"action in ctrl.item.data.data.actions\">\n      <button class=\"button-select phe-radio-button\" ng-click=\"ctrl.save_data(ctrl.item.data.data.actions[$index]);\">\n        <span>{{ctrl.showActionValue(ctrl.item.data.data.actions, action.key)}}</span>\n      </button>\n    </div>\n  </div>\n</div>\n",
  "consultation/views/questions/question-radio.html": "<div ng-if=\"ctrl.field\" >\n  <div class=\"answer-radio-box\">\n      <div class=\"answer-radio-list-container\" ng-class=\"{'answer-radio-line-container': ctrl.bigdialogmesures}\">\n\n        <!-- FIELDS -->\n        <div ng-repeat=\"field in ctrl.field.options\">\n          <button class=\"button-select phe-radio-button\"\n            ng-click=\"ctrl.save_data(ctrl.field.options[$index],'', ctrl.field.type)\">\n            <span>{{ctrl.showOptionValue(ctrl.field.options[$index])}}</span>\n          </button>\n        </div>\n\n        <!-- ACTIONS -->\n        <div ng-repeat=\"action in ctrl.field.actions\">\n          <button class=\"button-select phe-radio-button\"\n            ng-click=\"ctrl.save_data(ctrl.field.actions[$index]);\">\n            <span>{{ctrl.showActionValue(ctrl.field.actions, action.key)}}</span>\n          </button>\n        </div>\n      </div>\n  </div>\n\n</div>",
  "consultation/views/questions/question-rating.html": "\n<div ng-if=\"ctrl.field\" style=\"z-index:3;\" class=\"question-container\">\n\n    <!--////////////////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container is full_screen or popup-->\n    <!--////////////////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}}\n    </div>\n\n\n    <!--/////////-->\n    <!--INPUT BOX-->\n    <!--/////////-->\n    <div class=\"question-rating-box\">\n\n        <!--QUESTION inside question_box when show in timeline-->\n        <div ng-if=\"ctrl.field.question_context == 'single_question'\" class=\"question_field_answers_options_header\">\n            {{ctrl.field.labels[0].value}}\n        </div>\n\n        <div class=\"row question-rating-container\">\n\n            <div class=\"col-33 question-rating-resp-container question-field-option1\"\n                    ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3,\n                    'bounceOut': ctrl.field_question_value_animation == 1,\n                    'bounceOut-no': ctrl.field_question_value_animation != 1,\n                    'animated-bounce': ctrl.animation_faces == true }\"\n                    ng-click=\" ctrl.question_set_value( 3 ); \">\n                <div class=\"question-rating-resp\">\n                    <svg ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\" id=\"Capa_1\" data-name=\"Capa 1\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 74 74\"><defs><style>.cls-0{fill:#59595c;}</style></defs>\n                        <title>Bien</title>\n                        <path ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\" d=\"M41,3.8a37,37,0,1,0,37,37A37,37,0,0,0,41,3.8Zm0,69a32,32,0,1,1,32-32A32,32,0,0,1,41,72.8Z\" transform=\"translate(-4 -3.8)\"/>\n                        <path  ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\" d=\"M53.05,49.68a2.5,2.5,0,0,0-3.53,0,12.06,12.06,0,0,1-17,0A2.5,2.5,0,0,0,29,53.21a17.06,17.06,0,0,0,24.1,0A2.5,2.5,0,0,0,53.05,49.68Z\" transform=\"translate(-4 -3.8)\"/>\n                        <circle  ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\" cx=\"23.56\" cy=\"28.34\" r=\"2.5\"/>\n                        <circle  ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\" cx=\"50.44\" cy=\"28.34\" r=\"2.5\"/>\n                    </svg>\n                </div>\n                <div ng-class=\"{ 'optionSelected0': ctrl.question_selected_value == 3 }\">{{ctrl.question.options[2]}}</div>\n            </div>\n\n            <div class=\"col-33 question-rating-resp-container question-field-option2\"\n                    ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2,\n                    'bounceOut': ctrl.field_question_value_animation == 2,\n                    'bounceOut-no': ctrl.field_question_value_animation != 2,\n                    'animated-bounce': ctrl.animation_faces == true }\"\n                    ng-click=\" ctrl.question_set_value( 2 ) \">\n                <div class=\"question-rating-resp\">\n                    <svg id=\"Capa_1\" data-name=\"Capa 1\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 74 74\"><defs><style>.cls-1{fill:#59595c;}</style></defs>\n                        <title>Normal</title>\n                        <path ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2 }\" d=\"M41,3.8a37,37,0,1,0,37,37A37,37,0,0,0,41,3.8Zm0,69a32,32,0,1,1,32-32A32,32,0,0,1,41,72.8Z\" transform=\"translate(-4 -3.8)\"/>\n                        <path ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2 }\" d=\"M51.29,49.4H30.72a2.5,2.5,0,1,0,0,5H51.29a2.5,2.5,0,1,0,0-5Z\" transform=\"translate(-4 -3.8)\"/>\n                        <circle ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2 }\" cx=\"50.44\" cy=\"30.85\" r=\"2.5\"/>\n                        <circle ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2 }\" cx=\"23.56\" cy=\"30.85\" r=\"2.5\"/>\n                    </svg>\n                </div>\n                <div ng-class=\"{ 'optionSelected1': ctrl.question_selected_value == 2 }\">{{ctrl.question.options[1]}}</div>\n            </div>\n\n            <div class=\"col-33 question-rating-resp-container question-field-option3\"\n                    ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1,\n                    'bounceOut': ctrl.field_question_value_animation == 3,\n                    'bounceOut-no': ctrl.field_question_value_animation != 3,\n                    'animated-bounce': ctrl.animation_faces == true }\"\n                    ng-click=\" ctrl.question_set_value( 1 ) \">\n                <div class=\"question-rating-resp\">\n                    <svg id=\"Capa_1\" data-name=\"Capa 1\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 74 74\"><defs><style>.cls-2{fill:#59595c;}</style></defs>\n                        <title>Mal</title>\n                        <path ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1 }\" d=\"M41,3.8a37,37,0,1,0,37,37A37,37,0,0,0,41,3.8Zm0,69a32,32,0,1,1,32-32A32,32,0,0,1,41,72.8Z\" transform=\"translate(-4 -3.8)\"/>\n                        <path ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1 }\" d=\"M53.05,52.26a17.06,17.06,0,0,0-24.1,0,2.5,2.5,0,1,0,3.53,3.53,12.06,12.06,0,0,1,17,0,2.5,2.5,0,1,0,3.53-3.53Z\" transform=\"translate(-4 -3.8)\"/>\n                        <circle ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1 }\" cx=\"50.44\" cy=\"30.85\" r=\"2.5\"/>\n                        <circle ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1 }\" cx=\"23.56\" cy=\"30.85\" r=\"2.5\"/>\n                    </svg>\n                </div>\n                <div ng-class=\"{ 'optionSelected2': ctrl.question_selected_value == 1 }\">{{ctrl.question.options[0]}}</div>\n            </div>\n        </div>\n\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <button class=\"question-full-screen-button-ok\"\n                ng-disabled=\"ctr.send_rating_button_enabled\"\n                ng-click=\"ctrl.save_question()\">\n                <span ng-if=\"ctrl.field.question_context === 'card'\">Siguiente</span>\n                <span ng-if=\"ctrl.field.question_context === 'single_question'\">Guardar</span>\n            </button>\n        </div>\n\n    </div>\n\n</div>\n\n",
  "consultation/views/questions/question-select.html": "<div ng-if=\"ctrl.field\" class=\"question-container\">\n\n\n  <!--////////////////////////////////////////////////////////////////////-->\n  <!--QUESTION outside question_box when container is full_screen or popup-->\n  <!--////////////////////////////////////////////////////////////////////-->\n  <div id=\"question-full-screen-question\" ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n      {{ctrl.field.labels[0].value}}\n  </div>\n\n\n  <!--/////////-->\n  <!--INPUT BOX-->\n  <!--/////////-->\n  <div id=\"question-select-box\" class=\"question-select-box\" ng-hide=\"ctrl.animations_leave_page\">\n    <div class=\"phe-question-list-box\" ng-repeat=\"field in ctrl.field.options\" \n      ng-click=\"ctrl.selectListOption(field)\">\n\n      <!-- CIRCLE SELECTED OPTION FOR TYPE LIST -->\n      <i class=\"phe-list-icon icon\"  ng-class=\"{true: 'ion-ios-circle-filled selected', false: 'ion-ios-circle-outline'} [field.value == ctrl.selected_item.value]\">\n        <span class=\"phe-field-list-item\">{{field.labels[0].value}}</span>\n      </i>\n    </div>\n  </div>\n\n  \n\n</div>\n<div class=\"question-container\">\n  <div class=\"question-rating-box\" ng-hide=\"ctrl.animations_leave_page\">\n    <!--///////-->\n    <!--BUTTONS-->\n    <!--///////-->\n    <!--Buttons full screen and popup view-->\n    <div class=\"row question-buttons-popup\" >\n        <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n            Cerrar\n        </div>\n        <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\">\n            <span ng-if=\"ctrl.field.question_context === 'card' && !ctrl.field.is_last_question\">Siguiente</span>\n            <span ng-if=\"ctrl.field.question_context === 'single_question' || ctrl.field.is_last_question\">Guardar</span>\n        </div>\n    </div>\n  </div>\n</div>",
  "consultation/views/questions/question-slider.html": "\n<div ng-if=\"ctrl.field\" style=\"z-index:3;\" class=\"question-container\">\n\n\n    <!--///////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container in full_screen-->\n    <!--///////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}}\n    </div>\n\n\n    <!--////////////////////////////////////////////-->\n    <!--INPUT BOX. Contains different types of input ng-hide=\"ctrl.animations_leave_page == 'step3'\"-->\n    <!--////////////////////////////////////////////-->\n    <div class=\"question-rating-box\" ng-hide=\"ctrl.animations_leave_page\">\n\n        <!--QUESTION inside question_box when show in timeline-->\n        <div ng-if=\"ctrl.field.question_context == 'single_question'\" class=\"question_field_answers_options_header\">\n             {{ctrl.field.labels[0].value}}\n        </div>\n\n        <!--///////////-->\n        <!--SLIDER MODE-->\n        <!--///////////-->\n        <div class=\"question-slider-box\">\n            <!--Number indicator, only in Cards -->\n            <hr ng-if=\"ctrl.field.question_context === 'card'\" class=\"question-separator\">\n            <div ng-if=\"ctrl.field.question_context === 'card'\" class=\"question-selected-value\">\n                <div ng-class=\"{'number-animation': ctrl.numberAnimate}\"  class=\"question-number\">{{ctrl.color_slider_bar.value}}</div>\n            </div>\n            <!--Selector-->\n            <div class=\"question-selector-box\">\n                <div class=\"labels\">\n                    <div class=\"label-left\">{{ctrl.field.data.min_value_label[0].value}}</div>\n                    <div class=\"label-right\">{{ctrl.field.data.max_value_label[0].value}}</div>\n                </div>\n                <rzslider\n                    rz-slider-model=\"ctrl.color_slider_bar.value\"\n                    rz-slider-options=\"ctrl.color_slider_bar.options\">{{ctrl.color_slider_bar.options}}\n                </rzslider>\n            </div>\n        </div>\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\">\n                <span ng-if=\"ctrl.field.question_context === 'card' && !ctrl.field.is_last_question\">Siguiente</span>\n                <span ng-if=\"ctrl.field.question_context === 'single_question' || ctrl.field.is_last_question\">Guardar</span>\n            </div>\n        </div>\n    </div>\n\n</div>\n",
  "consultation/views/questions/question-static.html": "<div ng-if=\"ctrl.field\" class=\"question-container\">\n\n\n    <!--////////////////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container is full_screen or popup-->\n    <!--////////////////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}} <br />\n        <div class=\"phe-card-placeholder-info\"  ng-bind-html=\"ctrl.field.helps[0].value\" >\n        </div>\n    </div>\n\n    \n\n\n    <!--/////////-->\n    <!--INPUT BOX-->\n    <!--/////////-->\n    <div class=\"question-rating-box\" ng-hide=\"ctrl.animations_leave_page\">\n\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\">\n                <span ng-if=\"ctrl.field.question_context === 'card' && !ctrl.field.is_last_question\">Siguiente</span>\n                <span ng-if=\"ctrl.field.question_context === 'single_question' || ctrl.field.is_last_question\">Guardar</span>\n            </div>\n        </div>\n\n    </div>\n\n</div>",
  "consultation/views/questions/question-text-dialog.html": "<div keyboard-attach class=\"phe-question-textarea-box\">\n\n  <div class=\"item item-input\">\n\n      <!--Text input-->\n      <label class=\"phe-question-textarea-input\">\n        <textarea wrap=\"off\" rows=\"1\" minlength=\"1\" maxlength=\"1500\" ng-trim=\"true\" overflow-scroll=\"true\"\n          ng-model=\"ctrl.item_response\"\n          placeholder=\"Dudas...\">\n        </textarea>\n      </label>\n\n      <!-- Send message -->\n      <div class=\"phe-question-button\">\n        <ion-label class=\"button button-icon icon ion-android-send send-button\"\n          ng-disabled=\"!ctrl.item_response\"\n          ng-click=\"ctrl.save_data()\">\n        </ion-label>\n      </div>\n    </div>",
  "consultation/views/questions/question-text.html": "<div ng-if=\"ctrl.field\" class=\"question-container\">\n\n\n    <!--////////////////////////////////////////////////////////////////////-->\n    <!--QUESTION outside question_box when container is full_screen or popup-->\n    <!--////////////////////////////////////////////////////////////////////-->\n    <div ng-if=\"ctrl.field.question_context == 'card'\" class=\"question-full-screen-question\">\n        {{ctrl.field.labels[0].value}}\n    </div>\n\n\n    <!--/////////-->\n    <!--INPUT BOX-->\n    <!--/////////-->\n    <div class=\"question-rating-box\"ng-hide=\"ctrl.animations_leave_page\">\n\n        <!--QUESTION inside question_box when show in timeline-->\n        <div ng-if=\"ctrl.field.question_context == 'single_question'\" class=\"question_field_answers_options_header\">\n            {{ctrl.field.labels[0].value}}\n        </div>\n\n        <div class=\"row question-rating-container\">\n            <div keyboard-attach class=\"item-input\" style=\"width:100%;padding: 15px;\">\n                <label class=\"item-input-wrapper\" style=\"background: none;\">\n                    <input class=\"input-rounded\" placeholder=\"{{'write_message' | translate}}...\" ng-model=\"ctrl.question_value\" style=\"border-radius: 5px !important;border:1px solid rgb(103, 103, 103) !important;margin-top: 20%; padding: 10px !important; \">\n                </label>\n            </div>\n        </div>\n\n        <!--///////-->\n        <!--BUTTONS-->\n        <!--///////-->\n        <!--Buttons full screen and popup view-->\n        <div class=\"row question-buttons-popup\" >\n            <div class=\"question-full-screen-button-cancel\" ng-click=\"ctrl.close()\">\n                Cerrar\n            </div>\n            <div class=\"question-full-screen-button-ok\" ng-click=\"ctrl.save_question()\"  ng-disabled=\"!ctrl.question_value\">\n                <span ng-if=\"ctrl.field.question_context === 'card' && !ctrl.field.is_last_question\" >Siguiente</span>\n                <span ng-if=\"ctrl.field.question_context === 'single_question' || ctrl.field.is_last_question\"  >Guardar</span>\n            </div>\n        </div>\n\n    </div>\n\n</div>",
  "consultation/views/timeline.tpl.html": "<!--REPEAT ITEMS-->\n<div class=\"timeline-item-container\" ng-repeat=\"item_ui in ctrl.ui_items\">\n\n  <div data-id=\"{{item_ui.data.type}}\">\n\n    <!-- DAYS SEPARATOR-->\n    <div class=\"timeline-item\">\n      <div ng-if=\"item_ui.custom.is_first_in_day\" class=\"timeline-day-divider\">\n        <span class=\"timeline-day-divider-line\"></span>\n        <span>{{item_ui.data.creation_timestamp | amDateFormat: 'LL'}}</span>\n      </div>\n    </div>\n\n    <!--ITEM TYPE WITH SWITCH-->\n    <div class=\"timeline-item\" ng-switch on=\"item_ui.data.type\" ng-class=\"{'phe-margin-bottom-15': item_ui.custom.show_consultant_avatar || item_ui.custom.show_enduser_avatar}\">\n\n      <!-- Avatar and bubble pointer -->\n      <!-- Hide avatar for accepted proposals, new item appointment is created -->\n      <div ng-hide=\"item_ui.data.type === 3 && item_ui.data.status === 3\">\n          <div ng-if=\"item_ui.custom.show_consultant_avatar\" class=\"bubble-pointer-left\"></div>\n          <div ng-if=\"item_ui.custom.show_enduser_avatar\" class=\"bubble-pointer-right\"></div>\n          <phe-avatar class=\"item_avatar\" ng-if=\"item_ui.custom.show_consultant_avatar\" phe-user=\"item_ui.custom.consultant\"></phe-avatar>\n      </div>\n\n      <!-- Item main content -->\n      <div class=\"timeline-item-message\" ng-switch-when=\"1\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-message item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-file\" ng-switch-when=\"2\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-file item=\"item_ui\" consultation=\"ctrl.consultation\" />\n      </div>\n      <div class=\"timeline-item-proposal\" ng-switch-when=\"3\" ng-hide=\"item_ui.data.status == 3\"  ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-proposal item=\"item_ui\" consultation=\"ctrl.consultation\"></phe-consultation-item-proposal>\n      </div>\n      <div class=\"timeline-item-appointment\" ng-switch-when=\"4\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-appointment item=\"item_ui\"></phe-consultation-item-appointment>\n      </div>\n      <div class=\"timeline-item-call\" ng-switch-when=\"5\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-call item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-card-changes\" ng-switch-when=\"6\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-card-changes item=\"item_ui\" />\n      </div>\n      <div class=\"phe-padding-10\" ng-switch-when=\"9\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-stage-change item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-consultation-shared\" ng-switch-when=\"10\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-consultation-shared item=\"item_ui\" class=\"display-table\" />\n      </div>\n      <div class=\"timeline-item-card\" ng-switch-when=\"15\" ng-class=\"item_ui.custom.item_from\">\n        <ng-include src=\"'consultation/views/items/item_type_card.tpl.html'\"></ng-include>\n      </div>\n      <div class=\"timeline-item-closed-consultation\" ng-switch-when=\"16\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-closed-consultation item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-cancelled-consultation\" ng-switch-when=\"17\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-cancelled-consultation item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-waiting-room\" ng-switch-when=\"18\">\n        <phe-consultation-item-waiting-room item=\"item_ui\" />\n      </div>\n      <div ng-switch-when=\"19\">\n        <phe-consultation-item-question item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-response\" ng-switch-when=\"20\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-response item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-field-question\" ng-switch-when=\"21\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-field-question item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-field-answer\" ng-switch-when=\"22\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-field-answer item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-web-request\" ng-switch-when=\"23\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-web-request item=\"item_ui\" />\n      </div>\n      <div class=\"timeline-item-action-request\" ng-switch-when=\"24\" ng-click=\"ctrl.open_FSW(item_ui)\" ng-class=\"item_ui.custom.item_from\">\n        <phe-consultation-item-action-request item=\"item_ui\" />\n      </div>\n    </div>\n\n  </div>\n</div>\n\n<!--CONSULTANT TYPING-->\n<div ng-show=\"ctrl.consultant_typing\" class=\"timeline-item-container\">\n  <div class=\"timeline-item phe-margin-bottom-15\">\n\n    <!-- Avatar -->\n    <div class=\"bubble-pointer-left\"></div>\n\n    <!-- Loading-->\n    <div class=\"timeline-item-consultant-typing consultant\">\n      <div class=\"spinner spinner_small\">\n        <div class=\"bounce1\"></div>\n        <div class=\"bounce2\"></div>\n        <div class=\"bounce3\"></div>\n      </div>\n    </div>\n\n  </div>\n</div>\n",
  "consultation/views/unassigned_comm_channel_confirm.tpl.html": "<ion-view class=\"page-view phe-comm-channel\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\">\n    <div class=\"phe-comm-channel-container\">\n      <div class=\"phe-comm-channel-consultant\">\n        <phe-avatar phe-user=\"ctrl.consultant\"></phe-avatar>\n        <h4>{{ ctrl.consultant.presentation_name }}</h4>\n      </div>\n\n      <div class=\"phe-comm-channel-summary\">\n        <p>{{ 'comm_channel_attended_through' | translate }}</p>\n\n        <div class=\"phe-comm-channel-option-icons\">\n          <div ng-if=\"ctrl.consultation.communication_channel == 'video'\"\n               class=\"phe-comm-channel-option-icon icon ion-camera\"></div>\n          <div\n            ng-if=\"ctrl.consultation.communication_channel == 'video' || ctrl.consultation.communication_channel == 'audio'\"\n            class=\"phe-comm-channel-option-icon icon ion-android-microphone\"></div>\n          <div class=\"phe-comm-channel-option-icon icon ion-chatbubble\"></div>\n        </div>\n      </div>\n\n      <div class=\"phe-comm-channel-confirm\">\n        <p>{{ 'com_channel_question' | translate }}</p>\n        <div class=\"phe-comm-channel-confirm-buttons\">\n          <button class=\"button reject\" ng-click=\"ctrl.reject_consultation()\">\n            {{'reject_consultation_button'| translate}}\n          </button>\n          <button class=\"button success\" ng-click=\"ctrl.accept_consultation()\">\n            {{'go_consultation_button'| translate}}\n          </button>\n        </div>\n      </div>\n    </div>\n  </ion-content>\n</ion-view>\n",
  "consultation/views/unassigned_comm_channel_selection.tpl.html": "<ion-view class=\"page-view phe-comm-channel\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n    <ion-content has-header=\"true\" has-subheader=\"false\" padding=\"false\">\n      <div class=\"phe-comm-channel-container\">\n        <div class=\"phe-comm-channel-title\">\n          <h3>{{'com_channel_title'| translate}}</h3>\n        </div>\n\n        <div class=\"phe-comm-channel-option\" ng-repeat=\"channel in ctrl.channels\" ng-class=\"{true:'selected'}[channel.selected]\" ng-click=\"ctrl.set_comm_channel( channel.channel )\">\n          <div class=\"phe-comm-channel-option-icons\">\n            <div ng-repeat=\"channel_icon in channel.icons\" class=\"phe-comm-channel-option-icon icon ion-{{ channel_icon}}\"></div>\n          </div>\n        </div>\n\n        <div class=\"phe-comm-channel-button\" ng-class=\"{true:'disabled'}[!ctrl.channel_selected]\" ng-click=\"ctrl.continue()\">\n          <div class=\"button\">{{ 'continue' | translate }}</div>\n        </div>\n      </div>\n    </ion-content>\n</ion-view>\n",
  "consultation/views/unassigned.tpl.html": "\n<div ng-switch on=\"ctrl.mode\">\n\n  <div ng-switch-when=\"comm_channel_selection\">\n    <ng-include src=\"'consultation/views/unassigned_comm_channel_selection.tpl.html'\"></ng-include>\n  </div>\n\n  <div ng-switch-when=\"comm_channel_confirm\">\n    <ng-include src=\"'consultation/views/unassigned_comm_channel_confirm.tpl.html'\"></ng-include>\n  </div>\n\n</div>\n",
  "enduser/views/enduser_profile.tpl.html": "<ion-view class=\"page-view\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n        <button class=\"button button-icon\" phe-goclick=\"consultation.consultation_detail\">\n            <i class=\"icon ion-ios-arrow-left\"></i>\n        </button>\n        <h2 class=\"title\">{{'user_profile' | translate}}</h2>\n        <div class=\"buttons\"></div>\n    </ion-header-bar>\n\n    <ion-content class=\"phe-profile\">\n        <div class=\"row row-center padding-top\">\n            <div ng-click=\"ctrl.on_avatar_click()\" class=\"col text-center item-avatar phe-status-{{ctrl.consultant.status_text}}\">\n              <div ng-show=\"!ctrl.updating_avatar\" class=\"avatar\" style=\"background-image:url( '{{ctrl.enduser.picture_url || $root.theme_path + '/img/avatar.png'}}' )\">\n                  <i ng-show=\"$root.isOnline\" class=\"icon ion-camera\"></i>\n              </div>\n                <ion-spinner ng-show=\"ctrl.updating_avatar\" class=\"avatar phe-gallery-spinner\"></ion-spinner>\n            </div>\n        </div>\n\n        <input style=\"visibility: hidden\" type=\"file\" accept=\"image/*\" id=\"avatar_capture\" capture=\"camera\" fileread=\"ctrl._on_image_file_read\">\n\n        <div class=\"row\">\n        <div class=\"col col-25\"><i class=\"icon ion-person\"></i></div>\n        <div class=\"col col phe-profile-input\">{{ctrl.enduser.presentation_name}}</div>\n        <div class=\"col col-10\"></div>\n      </div>\n      <div class=\"row\" ng-if=\"ctrl.enduser.birthdate || ctrl.enduser.gender\">\n        <div class=\"col col-25\"></div>\n        <div class=\"col phe-profile-input\" ng-if=\"ctrl.enduser.birthdate\">{{'birthdate' | translate}}: {{ctrl.enduser.birthdate | date: \"dd-MM-yyyy\" }}</div>\n        <div class=\"col phe-profile-input\" ng-if=\"ctrl.enduser.gender\" ng-bind=\"{0:'{{'gender' | translate}}', 1: '{{'man' | translate}}', 2:'{{'woman' | translate}}'}[ctrl.enduser.gender]\"> </div>\n        <div class=\"col col-10\"></div>\n      </div>\n      <div class=\"row\" ng-if=\"ctrl.enduser.email\">\n        <div class=\"col col-25\"><i class=\"icon ion-email\"></i></div>\n        <div class=\"col col phe-profile-input\">{{ctrl.enduser.email}}</div>\n        <div class=\"col col-10\"></div>\n      </div>\n      <div class=\"row\" ng-if=\"ctrl.enduser.phone\">\n        <div class=\"col col-25\"><i class=\"icon ion-ios-telephone\"></i></div>\n        <div class=\"col col phe-profile-input\">{{ctrl.enduser.phone}}</div>\n        <div class=\"col col-10\"></div>\n      </div>\n    </ion-content>\n</ion-view>\n",
  "floating_side_window/fsw.tpl.html": "<ion-view class=\"page-view phe-card-viewer\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n\n  <!-- HEADER -->\n  <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n    <button class=\"button button-icon\" ng-click=\"ctrl.back()\" ng-if=\"ctrl.new_messages == 0\">\n      <i class=\"icon ion-ios-chatbubble-outline\"></i>\n    </button>\n    <button class=\"button button-icon\" ng-click=\"ctrl.back()\" ng-if=\"ctrl.new_messages > 0\">\n        <i class=\"icon ion-ios-chatbubble\">{{ctrl.new_messages}}</i>\n      </button>\n    <h2 class=\"title\">\n      {{ctrl.title}}\n    </h2>\n    <button class=\"button button-icon\" ng-click=\"ctrl.close()\">\n        <i class=\"icon ion-close-round\"></i>\n      </button>\n  </ion-header-bar>\n\n  <!-- CONTENT -->\n  <ion-content scroll=\"false\">\n\n    <!-- REPEAT CONSULTATION.FSW.ITEMS -->\n    <div ng-repeat=\"item in ctrl.consultation.fswItems\" ng-show=\"item.showIFrame\" class=\"phe-height-100\">\n      <iframe\n        style=\"height: 100%\"\n        width=\"100%\"\n        src=\"{{item.trustedUrl}}\"\n        sandbox=\"allow-same-origin allow-popups allow-scripts allow-top-navigation allow-forms\">\n      </iframe>\n    </div>\n  </ion-content>\n\n</ion-view>\n",
  "login/views/login.tpl.html": "<ion-view view-title=\"Login\" name=\"login-view\">\n  <ion-content class=\"padding phe-login\">\n    <div class=\"col text-center\">\n      <img src=\"{{$root.theme_path}}/img/login_logo.png\" style=\"width: 175px;\"/>\n    </div>\n    <div>\n      <h4 class=\"text-center login-welc\">{{'welcome' | translate}}</h4>\n    </div>\n    <div class=\"list list-inset\">\n      <label class=\"item item-input\" ng-repeat=\"field in ctrl.login_fields\">\n        <input ng-model=\"field.value\" ng-class=\"{color_f2f: ctrl.is_f2f, color: !ctrl.is_f2f}\" type=\"{{field.type}}\" placeholder=\"{{field.text}}\" ng-change=\"ctrl.input_change()\">\n      </label>\n    </div>\n    <button class=\"button button-block button-calm\" ng-click=\"ctrl.login()\">{{'login' | translate}}</button>\n    <div class=\"phe-log-error list list-inset\">\n      <label class=\"phe-log-error item item-input\">\n        <span class=\"error\">{{ctrl.error_text}}</span>\n      </label>\n    </div>\n    <div class=\"f2f-secondary-logo col text-center\" ng-if=\"ctrl.show_logo_footer\">\n      <img src=\"{{$root.theme_path}}/img/login_second_logo.png\"/>\n    </div>\n  </ion-content>\n</ion-view>\n",
  "remote_list/remote_list.tpl.html": "<ion-view class=\"page-view phe-remote-list\" ng-class=\"{true:'has-alert',false:''}[!$root.isOnline]\">\n    <ion-header-bar class=\"bar bar-header\" align-title=\"center\">\n      <button class=\"button button-icon\" ng-click=\"ctrl.back()\">\n        <i class=\"icon ion-ios-chatbubble-outline\"></i>\n      </button>\n      <h2 class=\"title\">\n          {{ctrl.item.data.data.dialog_title[0].value}}\n      </h2>\n    </ion-header-bar>\n  <ion-content scroll=\"false\">\n\n    <question-list\n      item=\"ctrl.item\"\n      consultation=\"ctrl.consultation\"\n      close=\"ctrl.back\">\n    </question-list>\n\n  </ion-content>\n\n</ion-view>",
  "shared/components/networkalertbar/network_alert_bar.tpl.html": "<div class=\"network-alert-bar-container\">\n  <div class=\"alertmessage\">\n    <i class=\"icon ion-alert-circled\"></i>\n    <p>{{'no_internet' | translate}}</p>\n  </div>\n</div>\n",
  "shared/views/loading.tpl.html": "<div ng-if=\"mini\" class=\"phe-spinner mini\">\n  <svg xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" version=\"1\" width=\"48px\" height=\"48px\" viewBox=\"0 0 28 28\">\n    <g class=\"qp-circular-loader\">\n      <path class=\"qp-circular-loader-path\" fill=\"none\" d=\"M 14,1.5 A 12.5,12.5 0 1 1 1.5,14\" stroke-linecap=\"round\" />\n    </g>\n  </svg>\n\n  <span class=\"phe-mask-text\">{{text}}</span>\n</div>\n\n<div ng-if=\"!mini\" class=\"phe-spinner\">\n  <svg xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" version=\"1\" width=\"48px\" height=\"48px\" viewBox=\"0 0 28 28\">\n    <g class=\"qp-circular-loader\">\n      <path class=\"qp-circular-loader-path\" fill=\"none\" d=\"M 14,1.5 A 12.5,12.5 0 1 1 1.5,14\" stroke-linecap=\"round\" />\n    </g>\n  </svg>\n\n  <div class=\"phe-mask-title\">{{title}}</div>\n  <div class=\"phe-mask-text\">{{text}}</div>\n</div>",
  "shared/views/plugin-info.tpl.html": "<ion-modal-view class=\"phe-home-box\" id=\"debug_modal\">\n  <div class=\"phe-home-box-content-wrapper\">\n    <div class=\"phe-home-box-icon\">\n      <img ng-if=\"$root.platform !== 'ios'\" ng-click=\"debug_click()\" src=\"{{$root.theme_path}}/img/home_box_icon.svg\" />\n      <object ng-if=\"$root.platform === 'ios'\" type=\"image/svg+xml\" data=\"{{$root.theme_path}}/img/home_box_icon.svg\"></object>\n    </div>\n    <div class=\"list\">\n    </div>\n\n    <ul class=\"list\">\n\n      <li ng-if=\"plugins_config.enduser_version\" class=\"item item-text-wrap\">\n        {{ plugins_config.enduser_version }}\n      </li>\n\n      <li ng-if=\"plugins_config.videocall_version\" class=\"item item-text-wrap\">\n        {{ plugins_config.videocall_version }}\n      </li>\n\n      <li class=\"item item-text-wrap\">\n        {{ 'webrtc_softphone' | translate }}: {{ plugins_config.use_webrtc | translate }}\n      </li>\n\n      <ion-toggle id=\"debug_toggle\" ng-show=\"show_debug_toggle\" ng-model=\"plugins_config.debug_enabled\" toggle-class=\"toggle-balanced\">Debug</ion-toggle>\n\n    </ul>\n\n    <div class=\"phe-home-box-button\" ng-click=\"close()\">{{'accept' | translate}}</div>\n  </div>\n</ion-modal-view>\n",
  "shared/views/popup.tpl.html": "<h5 ng-if=\"subtitle\" class=\"phe-popup-subtitle\">{{subtitle}}</h5>\n<div class=\"phe-popup-body\" ng-bind-html=\"body\"></div>"
};